(9603877, 2006100, '<p>Турникеты включены и работают на обоих платформах. В этом случае идём в сторону Ангарской улицы, проходим несколько десятков метров в сторону Москвы и залезаем на платформу по протоптанной дорожке. С платформы-в обратном порядке.</p>\r\n<p>Если Вы идёте с автобуса, так на платформу попадёте гораздо быстрее, нежели через "официальный" проход.</p>', '37.509405', '55.869736'),
(9603663, 2005275, 'Можно выйти если пройти в сторону МКАДа.', '37.468158', '55.887314'),
(9603478, 2005080, '<p>Обходинг достаточно прост. С областных торцов спрыгиваем и проходим в дырку на сортировочной станции, там же поднимаемся на надземный переход, если это нужно.</p>', '37.528172', '55.861738'),
(9603256, 2004764, NULL, '37.552388', '55.850121'),
(9603458, 2005060, '<p>Вокруг платформы построили трёхметровый основательный бетонный забор. Со стороны платформ в область забор длится аж до самого путепровода через Большую Академическую улицу. Впрочем, несмотря на кажущуюся неприступность - дырок разной удобности всё равно полно. Выход со стороны области - либо через традиционную калитку посередине деревянной платформы (в последнее время там стоит ЧОПовец и перекрывает проход своим телом), либо забор-лазинг за турникетами (недавно там наварили сверху дополнительных секций, поэтому проход усложнён), либо лонгволкинг в сторону Москвы - там где-то есть дырка пока строят бетонный забор.</p>\r\n<p>По состоянию на апрель 2016 - есть два прохода мимо бетонного забора, где идут строительные работы, расположены в разных концах платформы. Также есть дырка в заборе ближе к пешеходному мосту у метро. Выход с платформы "Из Москвы" везде подразумевает паровозинг или забор-лазинг. Наглые электричкеры перелезают прямо рядом с турникетами, менее наглые - на месте снесённых ларьков и авторныка (кстати, такой путь быстрее и короче, чем официальный через турникеты), также есть дырка ближе к метро, но в последнее время там наварили дополнительных секций, приходится перелезать хлипковатый, но удобный забор из двух секций по пояс. Всё равно экономит время по сравнению с официальным выходом. Иногда на платформе тусуются чоперы, которые вроде как должны гонять электричкеров. Лечатся указанием направления в сторону детородного органа. Применять паровозинг не очень рекомендуется в связи с обилием чоповцев у турникетных линий. Впрочем полностью исключать этот вариант тоже не стоит.</p>\r\n<p>Переходить по путям следует осторожно по причине движения Ласточек и Сапсанов. Крайне редко (раз в полгода-год) там проходят показушные рейды с журналистами и принималовом за хождение по путям. Стоит отметить, что МТППК совместно с РЖД особенно рьяно следит за дырками на "Петраше" и старается оперативно усложнять выход электричкерам.</p>\r\n<p>Проход к пл. Окружная теперь возможен только так:</p>\r\n<p><img style="border-width: 1px;" src="https://pp.vk.me/c630020/v630020475/352ff/Tn4TPtm_vNo.jpg" alt="Пройти от Петровско-разумовской к Окружной" width="1024" height="768" /></p>\r\n<p>Планируется, что платформы будут переносить ближе к метро и пересечению с Савёловским направлением.  </p>', '37.568878', '55.839487'),
(9603505, 2005110, '<p>Время от времени в заборе у первого вагона в Москву появляются вырезанные прутья. Если прутья заварены, то в сторону Москвы есть место, где можно протиснуться через забор. Можно применить забор-лазинг в любом удобном месте.</p>\r\n<p>Есть выход в сторону Москвы возле штрафстоянки. Также существует длинный обходинг до эстакады монорельса в сторону области.</p>\r\n<p>Раньше ЧОП на турникетах спал и бездельничал, а теперь следит. Иногда сразу два активных чоповца на павильон. В связи с этим для успешного выполнения паровозинга нужно обладать некоторой долей наглости и проворности. Северный павильон охраняют сильнее, чем южный. Внимательный электричкер заметит один хитрый и наглый способ обойти турникеты. Переход на другую платформу без тикета возможен только по путям. Также нужно учитывать, что на участке от платформы Останкино до Ленинградского вокзала движение поездов левостороннее.</p>', '37.603743', '55.81705'),
(9603518, 2005125, '<p>Спрыг с областного торца, 200 метров вдоль жд, и направо. Под Крестовском мостом со стороны Алексеевской дыра.</p>', '37.639214', '55.797074'),
(2006004, 2006004, '<p>На неизвестный срок (закрыли в 2016, обещали не меньше трёх лет) закрыт тоннель, ведущий в метро. Однако турникетный павильон там работает.</p>\r\n<p>Турникетов много, они отличаются высокими, отъезжающими вбок, створками, но пристроиться всё равно можно. ЧОП довольно агресссивен. Впрочем, иногда чоповцев может вообще не быть даже на турникетной линии у спуска сразу к метро (после того, как закрыли проход к метро, что пассажиров, что ЧОПовцев там найти сложно даже в час-пик). В турникетном павильоне, ведущем на ПДСные пути как правило кто-то дежурит, иногда можно и не встретить там ЧОП, только оператора дурникетов, которому пофиг на зайцев.</p>\r\n<p>Самый быстрый путь пересадки с ПДСа на электричку - через торцы пригородных платформ. Официальный проход подразумевает либо приобретение билета в автомате (который может не работать, а также не пробивает льготные билеты), либо лонгволкинг через здание вокзала, Комсомольскую площадь и вестибюль метро к кассам у фонтана. Можно попытаться проникнуть через забор около турникетного павильона, ведущего в метро. Также раньше существовал читерный проход через кафешки, имеющие вход как со стороны пригорода, так и со стороны ПДСов, после реконструкции возможно осталась, возможно не осталась лазейка.</p>\r\n<p>На торцах пригородных платформ утром и вечером дежурят 1-2 ЧОП с приветом из южных стран. Как правило, равнодушно относятся к зайцам. Самый простой способ попасть в пригородную зону: по самой ближней платформе ПДС к пригородным путям пройти до конца (особо хардкорным электричкерам можно до середины, и при наличии Ласточки, в середине сцепа пролезть между двумя головными вагонами), спрыгнуть с платформы и забраться на платформу между 2 и 4 путем (там есть даже лесенка, просьба быть осторожным, не сломайте ее, хрупкая). Забор между пригородными путями (сечас используются под ласточки) и ПДСными платформами демонтирован. Но использовать его для обходинга можно только если там нет поезда на путях.</p>\r\n<p>Совсем хардкорным электричкерам и ласточка не помеха из-за особенностей сцепки поездов (по схеме 5+5 вагонов). Есть служебный проход и калитка на самой крайней, 12-ой платформе. Служебный проход на платформе между 10 и 12 путем. На 14-ом (самом крайнем) - все наглухо заварено, закрыто и т.д.</p>\r\n<p>Недавно после реконструкции турникеты возле выхода из метро вынесли под открытое небо, добавив возможностей для успешного читерного прохода. Створки турникетов при зажатии паровозера немного разъезжаются, давая возможность пролезть даже с сумкой или рюкзаком.</p>', '37.654377', '55.778353'),
(9603401, 2005000, '<p>Есть способ обойти павильон через парк, нужно дойти до теннисного корта и выйти на жд пути,там легко можно догадаться куда идти и дойти до платформы и залезть на нее. Также можно обойти со стороны бывшего рынка (с правой стороны, если смотреть на кассы, где табло с временем).</p>\r\n<p>Чтоб попасть на платформу №1, нужно зайти под мост (с левой стороны, если смотреть на кассы, где табло с временем), там огромная дырка под забором или же можно пройти чуть дальше и не применять никаких усилий и просто выйти к жд, или же воспользоваться обходингом через парк/рынок.  </p>', '37.451679', '55.894383'),
(9603638, 2005250, '<p>На платформу в сторону Ленинградского вокзала, можно залезть со стороны торца на "Область", путём прохода от кассы или подземного перехода, прямо по тропинке вдоль платформы. Проход за забор к рельсам возможен с московского торца областной платформы (между забором и платформой достаточно широкая дырень (при оценке метров с 20 от нее).</p>', '37.381011', '55.924268');
INSERT INTO `#__rw2_old` (`yandex`, `express`, `detour`, `lt`, `lg`) VALUES
(9603404, 2005003, '<p>Турникеты действуют только в направлении на Москву. Что интересно, высокий анти-зайцевый забор тут 2х-контурный - один непосредственно вокруг платформы, второй метрах в 10 от неё. Под платформами приварены решетки.</p>\r\n<p>На отурникеченной платформе для перелаза нужно по асфальтированной дорожке подойти к левому спуску с пешеходного моста (он находится вне отурникеченной зоны, домик с турникетами и кассой находится у правого спуска), подняться на несколько ступенек - и от платформы вас отделяют лишь перила моста. Осталось только перелезть через них и спрыгнуть к электрону на Москву.</p>', '37.352115', '55.936524'),
(9603406, 2005005, '<p>В сторону "Области", платформы №2, турникетный павильон Закрыт, турникетных линеек вообще нет, проход свободный, можно выйти в город даже с любой части платформы.</p>\r\n<p>В сторону Ленинградского вокзала, платформы №1, работают турникеты. Обход путём спрыгивания с платформы и прохода через платформу №2, что идёт в сторону "Области".</p>', '37.334661', '55.941752'),
(9603486, 2005090, '<p>На платформе действует перронный контроль</p>\r\n<p>С пятницы, 15 марта 2019 года, проход к пригородным поездам и выход в город на станции Сходня будет осуществляться через турникеты. </p>', '37.298511', '55.949761'),
(9603604, 2005215, '<p>Забраться на платформу легко через торцы, однако торец со стороны переезда закрыт забором. Для хардкорных электричкеров есть вариант с андерплатформ-лазингом в любом удобном месте, либо забор-лазингом на выходе из подземного перехода. В середине февраля 2016 года из-за гибели двух человек на переезде, переезд перекрыли стандартным легкоперелезаемым ОЖДшным забором.</p>', '37.25082', '55.960369'),
(9603766, 2005381, NULL, '37.210564', '55.9693'),
(9600212, 2006200, '<p>В сторону "На Москву" со стороны Нового города работают турникеты</p>\r\n<p>Перронный контроль со стороны старого города.</p>', '37.173888', '55.980039'),
(9636942, NULL, NULL, '34.28508', '57.771188'),
(9603668, 2005280, NULL, '37.140709', '56.007945'),
(9603761, 2005376, NULL, '37.102203', '56.041789'),
(9603411, 2005010, '<p>Обход везде. В заборе выпилены прутья у лестниц и в мск и в область. Но проще и быстрей с торцов залезть.</p>', '37.077132', '56.063584'),
(9602925, 2004432, '<p>Спрыгиваем с московского торца на настил и идём в нужную сторону.</p>', '37.059434', '56.078996'),
(9603765, 2005380, NULL, '37.031641', '56.110225'),
(9603468, 2005070, 'Спрыгнуть с платформы и идти в сторону Москвы', '36.971658', '56.184183'),
(9603714, 2005326, NULL, '36.934242', '56.20674'),
(9603732, 2005346, NULL, '36.884242', '56.222648'),
(9603708, 2005320, NULL, '36.829166', '56.237691'),
(9603744, 2005359, NULL, '36.760828', '56.269747'),
(9603436, 2005036, NULL, '36.737605', '56.298325'),
(9602944, 2004451, '<p><strong>Вариант 1</strong></p>\r\n<p>Существует путем возвращения со станции в город и лонгволкинга в сторону автомобильного моста через жд. Проходим под мост и идем к торцам платформ (не огорожены, солидолом мажутся крайне редко-но проверять надо). Далее платформлазинг, а если в тупике стоит собака - еще и догхелпинг. БыдлоЧОПа нет вообще (стоят рядом с перронным контролем).</p>\r\n<p><strong>Вариант 2</strong></p>\r\n<p>Можно пройти в сторону вокзала до конца, а там пройти по настилам через товарную станцию (редко бывает ЛОВД в том месте).</p>\r\n<p><strong>Вариант 3</strong></p>\r\n<p>Можно пройти так же через ворота, они обычно открыты, если нет то можно воспользоваться дыркой в заборе около парковки(дырка левее если смотреть на ворота, там есть тропинка к ней).</p>\r\n<p><strong>Вариант 4</strong></p>\r\n<p>Можно перейти по пешеходному мосту до конца(ул.трудовая) и зайти там.</p>', '36.709951', '56.332636'),
(9603464, 2005066, '<p>08.15 - 17.15</p>\r\n<p>Перерыв</p>\r\n<p>11.30-12.00</p>\r\n<p>13.30-14.30</p>\r\n<p>Выходной</p>\r\n<p>Среда, Четверг</p>', '36.622351', '56.403804'),
(9602945, 2004452, NULL, '36.567109', '56.449754'),
(9603509, 2005114, NULL, '36.503671', '56.501926'),
