(9602593, 2004100, '<p>Проще некуда. Спрыгивайте с любого торца любой платформы. Обратно также.</p>', '36.439038', '56.551147'),
(9603507, 2005112, NULL, '36.333994', '56.611544'),
(9602946, 2004453, '<p>Проще некуда. Спрыгивайте с любого торца любой платформы. Обратно также.</p>', '36.295652', '56.644884'),
(9603423, 2005022, NULL, '36.220233', '56.702693'),
(9603871, 2006001, NULL, '36.138922', '56.716086'),
(9603829, 2005452, NULL, '36.043123', '56.755167'),
(9603790, 2005405, 'Не функционирует ', '35.980212', '56.801143'),
(9603093, 2004600, '<p>У московского торца есть лесенка, а напротив дырка и выход к улице железнодорожников. Для того, чтобы попасть в основную часть города - нужно дойти до магазина "69 тупик" и по подземному переходу. Или же дойти до спуска с "московских платформ" на "бологовские" и налево через калитку "служебный проход". Ранним утром, по крайней мере, такой способ выхода работает, причем идут толпы, многократно проверено одним из админов. А вот направо все так, как написано ниже:</p>\r\n<p>Калитки охраняются охранниками и без удостоверения не пускают через станцию.</p>', '35.891997', '56.835593'),
