(9600881, 2000215, 'С западной стороны у подземного перехода можно через забор перелезть, там прут решетки посередине очень удобно приварен. Либо напротив южного торца платформы с той же западной стороны от платформы есть свободный выход на улицу.', '37.45077', '55.683215'),
(9600771, 2000105, '<p>Возможен обходдинг с обеих торцов платформы. Кроме того, очень лёгок забор-лазинг. Очень редко во время рейдов на торцах дежурят пофигистичные ЧОПовцы.</p>\r\n<p>Паровозик прокатывает хорошо.</p>', '37.481479', '55.704553'),
(9601342, 2000690, NULL, '37.424358', '55.66684'),
(9600981, 2000315, '<p>С областного торца любой платформы можно спрыгнуть и дойти до пешеходного перехода через ЖД пути где можно выйти в город.</p>', '37.384982', '55.657165'),
(9602014, 2001795, '<p>Обходинг легкий в обе стороны - в сторону Калуги просто спрыгиваем у турникетного павильона и проходим 50м до переезда; в сторону Москвы же спрыгиваем с торца и проходим метров 100 до окончания забора.</p>\r\n<p>Также в заборе время от времени появляются дырки, есть удобные варианты его перелезть.</p>', '37.355125', '55.656268'),
(9601731, 2001143, NULL, '37.315011', '55.646166'),
(9799753, 2001004, '<p>Обходинг легчайший: если нужно попасть на платформу - то проще зайти с северной части платформы, со стороны ж/д переезда со шлагбаумом, обходите по путям здание касс - и вы, как белый человек, по лестнице или пандусу входите на платформу (с южной стороны можно обойти забор, но на платформу уже придётся лезть).</p>\r\n<div align="left">Если нужно выйти с платформы (с приехавшего поезда) - первый вариант: дождаться пока все пассажиры уйдут в здание павильона к турникетам (а вместе с ними и быдланчик), и спокойно пройти мимо павильона по путям к переезду. Второй вариант: сразу спрыгивать с южного края платформы и идти вдоль забора (не актуально для сырой погоды - пока дойдёшь до асфальта, все штаны в грязи будут).</div>', NULL, NULL),
