(9602145, 2001966, NULL, '36.900471', '55.388662'),
(9600821, 2000155, '<p>Спрыгиваете с любой платформы в сторону Мск и доходите до отмеченного здания. Там калитка. Если калитка закрыта, что бывает только рано утром, то переходите через пути на противоположную сторону.</p>\r\n<p> <a title="Как обойти турникеты на станции Фили" href="images/wayout/Fili.jpg" target="_blank" rel="noopener noreferrer"><img src="images/wayout/Fili_small.jpg" alt="Как обойти турникеты на станции Фили" width="480" height="640" /></a></p>\r\n<p><strong>Вариант, актуальный всегда</strong></p>\r\n<p>Спрыгиваете с любой платформы в сторону области, поворачиваете направо и идёте по подъездным путям до метро.</p>', '37.514527', '55.744262'),
(9601728, 2001140, '<div class="wk_header"><strong>Торцы в сторону области</strong></div>\r\n<p>Спрыгиваем с любой платформы в сторону области. Если спрыгнули с платформы на Москву, переходим мост по путям до начала платформы в область. Видим слева калитку, если открыта - выходим через калитку и идём/едем к метро/куда_надо. Если нет - переходим пути и выходим на улицу Ивана Франко.</p>\r\n<div class="wk_sub_header"><strong>В сторону Москвы</strong></div>\r\n<p>Спрыгиваем с любой платформы в сторону Москвы. По левой стороне забор быстро кончится и выйдите к бизнес-центру.</p>\r\n<div class="wk_header"><strong>Пешеходный мост</strong></div>\r\n<p>На Кунцево есть пешеходный мост, часть которого перестала функционировать после установки турникетов. Части разделены забором, в котором иногда бывает дырка.</p>\r\n<div class="wk_sub_header">1. Можно пролезть, если есть актуальная дырка.</div>\r\n<div class="wk_sub_header">2. Сам мост нам не нужен. Смотрим, куда спускается недействующая лестница. Видим, что она спускается к бизнес-центру. У самого спуска отколота верхняя часть забора. Её периодически заделывают, но довольно редко, ибо всё равно те, кому надо, выйдут. Спрыгиваем на пути, переходим их. Перелезаем забор и оказываемся у бизнес-центра. Далее кому куда надо. Затруднено, если на путях стоят поезда.</div>\r\n<div class="wk_sub_header"> </div>\r\n<div class="wk_header"><strong>Забор</strong></div>\r\n<p>Забор в Кунцево на платформе на Москву - один из немногих кошерных заборов, оставшихся таковым с момента начала повальной дурнекитизации железной дороги. Поясню. Забор, к примеру, в Филях или на Каланчевской или Новой, такой, что, перелезая его, можно напороться на пики яйцами. В Кунцево же забор "трубчатый". То есть сетчатый сам забор имеет 3 горизонтальных трубы: внизу, по центру "типа перила" и наверху. Не нужно иметь семь пядей во лбу, чтобы догадаться, как его перелезать - хватаемся за верхнюю трубу, ставим ноги на среднюю, далее перелезаем и прыгаем. </p>', '37.448946', '55.726819'),
(9600911, 2000245, '<p>stay tuned</p>\r\n<p><img src="images/404.jpg" alt="404" width="640" height="426" /></p>', '37.414471', '55.726916'),
(9600941, 2000275, '<p>Станция проста как пять копеек. Спрыгиваем с платформы и обходим заборы. Ну или перелезаем через забор прямо на/с платформы, только осторожно, там может быть колючка.</p>', '37.397258', '55.723706'),
(9602258, 2002910, NULL, '37.375173', '55.715845'),
(9602218, 2002081, NULL, '37.337351', '55.696325'),
(9601338, 2000685, '<p>Народ обходит со стороны Одинцово, с московской стороны обходить дольше (хотя, если перелезать на стыках платформы и забора - ближе к магазинам с обеих сторон).</p>', '37.314403', '55.682528'),
(9602450, 2003950, NULL, '37.392498', '55.729727'),
(9601679, 2001074, NULL, '37.347472', '55.734192'),
(9601701, 2001098, NULL, '37.29523', '55.739239'),
(9601655, 2001049, NULL, '37.262434', '55.737435'),
(9601663, 2001057, NULL, '37.239019', '55.733321'),
(9601678, 2001073, NULL, '37.211403', '55.729267'),
(9600721, 2000055, '<p>Слезть с платформы и пройти вдоль забора в сторону области. Справа будет дверь, периодически бывает открытой. Если она закрыта, то идём дальше до служебной дырки с левой стороны забора. <br /><br /><strong>Второй по сложности путь.</strong></p>\r\n<p>Прямо за вторым выходом (ближним к Москве) раньше была дыра в заборе, которую периодически заваривали и на следующий день резали снова. Увы, но заведующий штатным болторезом то ли переехал, то ли купил машину, так что сейчас там просто забор с множеством боевых ранений. Однако никто не запрещает его просто перелезть у павильона. <br /><br />С этой же стороны можно спрыгнуть и пройти вдоль забора с южной стороны (там заводы, не перепутаете) - метров через сто начинается отклонение заводской ветки, есть тропинка. </p>', '37.282548', '55.672323'),
(9601231, 2000570, '<p>Тут все просто - обойти турникеты легко с обоих торцов, заборы короткие. С московской стороны сразу за окончанием забора даже настил есть.</p>', '37.250788', '55.667763'),
(9601641, 2001029, '<p>Спрыг с платформы и до конца забора.</p>', '37.211944', '55.665204'),
(9601172, 2000510, NULL, '37.183471', '55.661235'),
(9602229, 2002097, NULL, '37.151158', '55.650152'),
(9601212, 2000550, '<div class="wk_sub_header"><strong>Вход</strong></div>\r\n<p>На платформу можно забраться по торцу рядом с турникетным павильоном или с другого конца платформы. Осторожно, платформа достаточно высока, а зимой торец покрывается льдом!</p>\r\n<div class="wk_sub_header"><strong>Выход</strong></div>\r\n<p>Чтобы выйти можно просто спрыгнуть на пути и дойти 15 метров до переезда, по расстоянию точно так же, как и через турникет. Минус в том, что это несколько опасно падением, особенно зимой, а электрички и ПДСы имеют очень неприятное свойство неожиданно выныривать из-за поворота.</p>', '37.097443', '55.641844'),
(9601725, 2001137, NULL, '37.066488', '55.63594'),
(9601658, 2001052, NULL, '37.029323', '55.626372'),
(9602265, 2002920, '<p>Обход крайне элементарный - с обоих краёв платформы, есть вариант и перелезть через забор возле турникетного павильона (паркур начального уровня). Будьте внимательны, иногда края платформ солидолят. <br /><br />Также почти всегда открыта калитка, расположенная от платформы в область где-то по середине среди товарных поездов (если будут стоять).</p>', '36.986861', '55.615205'),
(9600777, 2000111, NULL, '36.872783', '55.611073'),
(9601659, 2001053, NULL, '36.976255', '55.646959'),
(9601746, 2001162, NULL, '36.962522', '55.670468'),
(9601858, 2001312, NULL, '36.913133', '55.678641'),
(9601368, 2000725, NULL, '36.88055', '55.700584'),
(9601717, 2001127, NULL, '36.822963', '55.60256'),
(9601817, 2001254, NULL, '36.786726', '55.596301'),
(9602459, 2003959, NULL, '36.745757', '55.589051'),
(9600748, 2000082, NULL, '36.691615', '55.579437'),
(9601733, 2001146, NULL, '36.635107', '55.579055'),
(9601718, 2001128, NULL, '36.566408', '55.585752'),
(9601864, 2001322, NULL, '36.532538', '55.590689'),
(9600982, 2000316, NULL, '36.727291', '55.601503'),
(9602011, 2001790, '<p>Ближе всего обходить с московского торца по тропинке. Можно также перелезть забор в середине платформы.</p>', '36.468305', '55.597353'),
(9601754, 2001176, NULL, '36.44889', '55.585657'),
(9601840, 2001289, NULL, '36.402098', '55.553652'),
(9601629, 2001002, NULL, '36.371737', '55.546381'),
(9601799, 2001233, NULL, '36.309372', '55.537816'),
(9601773, 2001199, NULL, '36.219528', '55.511539'),
(9601890, 2001356, NULL, '36.126063', '55.499411'),
(9601664, 2001058, NULL, '36.064301', '55.49414'),
(9601006, 2000340, '<p>Последний вагон из Москвы, поворачиваем голову налево и видим отсутствие секции забора.</p>\r\n<p>Так же на нечётной стороне примерно посередине платформы есть калитка, которая всегда открыта.</p>', '36.034249', '55.49386'),
(9601137, 2000475, '<p>На крайней платформе в сторону Калуги есть много залазов.</p>\r\n<p>Во первых, между забором и платформой приличное расстояние, так что худые электричкеры могут вполне просто пролезть под забором в районе остановки последнего вагона и спрыгнуть. Также у самого края под платформой есть дыра, которая иногда заделывается. Обходинг тоже вполне возможен, если идти от этой платформы в сторону Москвы, забор через некоторое расстояние уйдет в холм.</p>\r\n<p>Так-же у первого вагона из Москвы у калужской платформы есть калитка которая почти всегда открыта, если же она закрыта, то идём чуть дальше и там пути уходят за забор к ЛОВД! ВНИМАНИЕ, ВОЗМОЖНО ПРИНИМАЛОВО !  <br /><br />А для выхода с другой платформы прыгайте у последнего вагона и идите по заросшему пути до конца забора.</p>', '36.751257', '55.383339'),
(9601820, 2001258, NULL, '36.705036', '55.359304'),
(9601804, 2001239, NULL, '36.672554', '55.317497'),
(9601749, 2001167, NULL, '36.667785', '55.24106'),
(9601347, 2000695, NULL, '36.662562', '55.178387'),
(9601907, 2001375, '<p>Либо обход по забору в сторону Калуги с платформы от Москвы (занимает порядка 3-5 минут), либо запрыг/спрыг через забор ближе к ТЦ Атлас (с платформы на Калугу, 1-2 минуты, однако прыгать придётся довольно высоко).</p>', '36.618412', '55.092699'),
(9602311, 2002990, NULL, '36.553397', '55.053456'),
(9601002, 2000336, '<p>Платформа на Москву, с Калужской стороны открыта калитка. Кликабельные фотки:</p>\r\n<p><a href="images/wayout/Maloyar-1.jpg"><img style="border-width: 1px;" src="images/wayout/Maloyar-1_small.jpg" alt="Как обойти турникеты на станции Малоярославец" width="480" height="270" /></a></p>\r\n<p><a href="images/wayout/Maloyar-2.jpg"><img style="border-width: 1px;" src="images/wayout/Maloyar-2_small.jpg" alt="Как обойти турникеты на станции Малоярославец" width="480" height="270" /></a></p>', '36.480663', '55.00694'),
