(9601788, 2001220, '<div class="wk_header"><strong>В сторону м. Печатники:</strong></div>\r\n<p>В заборе у гаражного кооператива в сторону Текстильщиков есть дыра, затем можно с легкостью подняться на любую платформу. <br />Идешь в сторону Москвы по левой стороне, метров через 400 можно будет выйти через гаражи или если пройти чуть дальше, ближе к мосту будет поворот налево, а там и проход к дороге. Выход будет в 50ти метрах от м. Печатники.</p>\r\n<div class="wk_sub_header"><strong>На Люблинскую улицу:</strong></div>\r\n<p>Нужно идти в сторону на Москву по правой стороне путей. В конце-концов после забора будет начинаться маленькая лесополоса а затем тропинка, ведущая к дырке в заборе. Недалеко есть остановки автобусов 54, 228, С4, 350, 623, 633, 650 и троллейбуса 50 до различных метро.</p>\r\n<div class="wk_sub_header"><strong>С другой стороны:</strong></div>\r\n<p>Есть вариант выйти на противоположной стороне станции. При выходе нужно идти справа от забора, там будет тропинка. Выход буде около туннеля под Ж/Д. Забор там заканчивается, так что можно без проблем выйти на улицу. Выход на ул. Полбина. Недалеко есть остановка автобусов 30, 646 и маршруток 528, 539.</p>\r\n<p><strong>К МФЦ Люблино:</strong></p>\r\n<p>Близ остановки и МФЦ Люблино можно безпрепятсвенно выйти из Люблино.</p>\r\n<p><b>В любом случае на дорогу уходит минут 10-15 минут.</b></p>\r\n<div class="wk_header"> </div>', '37.73372', '55.685067'),
(9600711, 2000045, '<div class="wk_header">Спрыгиваем из первого вагона из области (или последний в сторону области). Можно пойти направо, подняться на горку и попасть к метро и остановкам НОТ. Можно пойти налево, спрыгнуть и попасть сразу в метро.</div>', '37.729527', '55.707074'),
(9600866, 2000200, NULL, '37.702536', '55.733813'),
(9601185, 2000523, NULL, '37.429431', '54.885924'),
(9600830, 2000164, '<div class="wk_header">С конца августа 2015 вся станция обнесена онанозабором, дырок в нём не имеется. Верный способ выскочить - паровозик. Охране на него по фигу. Абсолютно.</div>\r\n<div class="wk_header"> </div>\r\n<div class="wk_header">Часто открыта калитка на низкой платформе, но иногда рядом с ней дежурят менты, чтобы принять за переход путей в неположенном месте.</div>\r\n<div class="wk_header"> </div>\r\n<div class="wk_header">Также открыта калитка в ста метрах в сторону города Тула, напротив магазина Пятёрочка.</div>', '37.4516', '54.935381'),
(9600832, 2000166, NULL, '37.451217', '54.960542'),
(9601661, 2001055, NULL, '37.461589', '54.994893'),
(9602216, 2002079, '<p>перерыв 12.40 - 13.40</p>', '37.477286', '55.040361'),
(9601743, 2001159, NULL, '37.494811', '55.092355'),
(9601062, 2000400, '<div class="box_body">\r\n<div class="wk_text">Для выхода на привокзальную площадь нужно спрыгнуть с серпуховского торца платформы и перейти по настилу.</div>\r\n<div class="wk_text"><br />Также имеется в наличии дыра в заборе, которым перегорожен проход к новым домам с северного торца платформы.</div>\r\n<div class="wk_text"><br />Отсутствует часть забора по правую сторону если смотреть в Москву. Находится напротив таблички "Чехов", которая висит рядом со входом в подземный переход.</div>\r\n</div>', '37.490053', '55.149144'),
(9602222, 2002089, NULL, '37.486876', '55.181334'),
(9602313, 2002992, NULL, '37.484627', '55.222348'),
(9601626, 2000999, NULL, '37.493575', '55.248793'),
(9601752, 2001173, NULL, '37.504249', '55.279894'),
(9601276, 2000615, NULL, '37.515127', '55.311932'),
(9601297, 2000636, NULL, '37.519251', '55.21838'),
(9601827, 2001267, NULL, '37.742163', '55.178894'),
(9602189, NULL, NULL, '37.628884', '55.171168'),
(9601157, 2000495, '<div class="box_body">\r\n<div class="wk_text">На южном торце легальный переход по настилу демонтирован, так как имеется подземный переход. Для выхода нужно прыгать с платформы (высота 1 м). Если пойти направо к улице Железнодорожной, у выхода из подземного будет достаточно большая дыра под забором, далее в 100 метрах будет дыра прямо в заборе (наиболее удобный выход), вообще не латается, еще через 200 метров забор закончится. Если пойти налево к улице Товарной, сразу после платформы будут ворота, в 99% случаев открыты.\r\n<ul>\r\n<li class="im-mess im_in _im_mess _im_mess_5102" data-ts="1549538270" data-msgid="5102" data-peer="295338417">\r\n<div class="im-mess--actions"> </div>\r\n<div class="im-mess--text wall_module _im_log_body">Также на северном торце обеих платформ (у моста) турникеты хорошо проходятся паровозиком. Быдлан или бабка могут сидеть в будке и лениво поглядывать в их сторону. В подземном переходе обычно 2 быдлана, агрессивные, пройти вдвоем не дают.</div>\r\n</li>\r\n<li class="im-mess im_in _im_mess _im_mess_5103" data-ts="1549538558" data-msgid="5103" data-peer="295338417">\r\n<div class="im-mess--actions"> </div>\r\n<div class="im-mess--text wall_module _im_log_body">На всех торцах платформ треугольники, на серпуховской (1 путь) около южного торца сбоку есть деревянная ступенька. А вообще платформы не очень высокие, зимой залезть еще легче (появляется ледяная ступенька с южного торца), на самый крайний случай дог-хелпинг.</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>', '37.526832', '55.356993'),
(9601207, 2000545, NULL, '37.534511', '55.385165'),
(9601494, 2000865, NULL, '37.54862', '55.403796'),
(9600731, 2000065, '<p><span style="color: #ff6600;">На платформе в область на торце последнего вагона покрасили забор! Будьте акуратнее при залазе!</span></p>\r\n<p>Вариантов много, большинство указано на схеме. Обходинг: перелезть через забор, но это требует физических навыков у электричкера. Как вариант - паравозинг. К счастью, быдланы немногочисленные и зачастую пофигистичные.</p>\r\n<p>На станции Подольск, если проходить через турникеты дальше от будки с надсмотрщиками, то можно пройти вовсе незамеченным, т.к. весь народ прет рядом с ними и, соответственно, чоповец переключает всё внимание сюда, а там хоть трава не расти (это турникеты в начале платформы в область), а в хвосте платформы второй турникет от окна можно вообще без препятствий пройти, стоит только боком повернуться, там и охранник и тетка на это редко когда реагируют.</p>\r\n<p>Схема обходинга к автовокзалу:</p>\r\n<div class="wk_header"><a title="Как обойти турникеты в Подольске" href="images/wayout/Podolsk-scheme.jpg"><img src="images/wayout/Podolsk-scheme_small.jpg" alt="Как обойти турникеты в Подольске" width="585" height="480" /></a></div>\r\n<div class="wk_header">Сами ворота:</div>\r\n<div class="wk_header"><a title="Как обойти турникеты в Подольске" href="images/wayout/Podolsk-1.jpg"><img src="images/wayout/Podolsk-1_small.jpg" alt="Как обойти турникеты в Подольске" width="480" height="640" /></a></div>', '37.565377', '55.431901'),
(9602273, 2002952, '<p>Хорошо работает паровозик. <span style="text-decoration: line-through;">Также забор очень удобен для того, чтобы его перелезать.</span> В скором времени станция будет оснащена нанозабором<span style="text-decoration: line-through;"><br /></span></p>\r\n<p>В сторону мск в 50 метрах находится легальный переход.</p>\r\n<p>В сторону Серпухова почти всегда есть дыра в заборе, но периодами её заваривают.</p>\r\n<p> </p>', '37.555412', '55.470629'),
(9600951, 2000285, NULL, '37.562217', '55.510494'),
(9601291, 2000630, '<p>Основной залаз - через большую дырку в заборе с восточной стороны. Также на пути можно спуститься с лестницы, что ведёт к турникетам московской платформы.</p>', '37.570613', '55.541249'),
(9600703, 2000037, NULL, '37.611501', '55.57124'),
(9601943, 2001420, NULL, '37.615095', '55.589453'),
(9601256, 2000595, '<p class="box_body">Спрыгиваем в сторону области и спокойно выходим. Кликабельная пикча:</p>\r\n<p class="box_body"><a title="Как обойти турникеты на Покровской" href="images/wayout/Pokrovskaya.jpg"><img src="http://elektrichking.ru/images/wayout/Pokrovskaya_small.jpg" alt="Как обойти турникеты на Покровской" width="480" height="270" /></a></p>\r\n<p class="box_controls_wrap"> Чтобы попасть на платформу, используем догхэлпинг.</p>', '37.632583', '55.603327'),
(9600891, 2000225, '<div class="wk_header">На станции хорошо работает паровозик. Также забор в ряде мест легко <span style="text-decoration: line-through;">перелазится</span>. Забор обновлён на более высокий. </div>\r\n<div class="wk_header"> </div>\r\n<div class="wk_sub_header"><strong>Калитка:</strong></div>\r\n<p>Идём по правой стороне радио-рынка, далее вдоль бетонного забора, забор кончается, направо через пути, видим калитку (в 99% открыта), проходим через нее и выходим на платформу. <br /><br />Под пешеходным мостом есть <span style="text-decoration: line-through;">дыра в заборе</span>(часто латается) со стороны пл. на Москву. Также несложно перелезть через перила моста на стороне пл. в область.</p>\r\n<p>Если пройти от моста в сторону метро, то есть также ворота, которые либо закрыты на цепочку без замка, либо просто открыты настежь.</p>\r\n<p> </p>\r\n<p>В сторону Москвы в районе пересечения путей с Луганской улицей забор кончается.</p>', '37.668481', '55.617984'),
(9601711, 2001120, '<div class="wk_header">Спрыг с последнего вагона из области и вверх направо, забор быстро кончается.</div>\r\n<p><a title="Как обойти турникеты на станции Москворечье" href="images/wayout/Moskvorechye.jpg" target="_blank" rel="noopener noreferrer"><img src="images/wayout/Moskvorechye_small.jpg" alt="Как обойти турникеты на платформе Москворечье" width="480" height="358" /></a></p>', '37.689863', '55.64094'),
(9601898, 2001365, NULL, '37.71679', '55.661307'),
(9602245, 2002780, NULL, '37.72838', '55.67424'),
(9601813, 2001250, NULL, '37.688808', '55.745427'),
(2000001, 2000001, '<h3 class="wk_header">Для платформ Горьковского направления:</h3>\r\n<div class="wk_header">Следует спрыгнуть с торца платформы, высота примерно 1.30 метра, во всяком случае можно слезть по морде электрички, далее нужно дойти до 10 тупика. Около него имеется дырка в заборе. Для удобства и быстрого прохождения рекомендуется использовать последний вагон из области. </div>\r\n<div class="wk_header"> </div>\r\n<h3 class="wk_header">Для платформ Курского, Рижского и Белорусского направлений:</h3>\r\n<p>Турникеты есть и включены на платформах 2 и 5.</p>\r\n<p><br /><strong>Платформа №2 (в сторону Царицыно):</strong></p>\r\n<p>Приходим на 1 низкую или 3 высокую платформу. Спрыгиваем на пути в сторону последнего вагона, далее обычный залаз на платформу, либо догхэлпинг. Чтобы выйти с платформы, спрыгиваем с 1 вагона и идём либо на 3, либо на 4 платформу, либо сразу к воротам на 1 платформе. <b>Остерегайтесь ментов. Штраф за переход путей 100р.</b> </p>\r\n<div class="wk_sub_header"><strong>Платформа №5 (в сторону Каланчёвской):</strong></div>\r\n<p>Спрыгиваем с последнего вагона из области на служебный проход и переходим на 3 или 4 платформу. Быдло игнорим.<br /><br /></p>', '37.660784', '55.757383'),
(2001005, 2001005, '<p>Спрыгиваете из последнего вагона со стороны Курского вокзала, держитесь правой стороны. Идёте, переходите два моста, пока не увидите справа дырку в заборе напротив вентиляционной шахты метро. Выходите, обратно тем же путём. Примерное время на обход - от 10 минут.</p>', '37.651602', '55.776017'),
(9601266, 2000605, '<p>Переходите по мосту на платформу Рижская Ленинградского направления, идёте по ней, в сторону из Москвы, пока не увидите огромную дыру в заборе.</p>\r\n<p>Кликабельные пикчи:</p>\r\n<p><a title="Как обойти турникеты на Ржевской" href="images/wayout/Rzhevskaya-1.jpg"><img src="images/wayout/Rzhevskaya-1_small.jpg" alt="Как обойти турникеты на Ржевской" width="480" height="360" /></a></p>\r\n<p><a title="Как обойти турникеты на Ржевской" href="images/wayout/Rzhevskaya-2.jpg"><img src="images/wayout/Rzhevskaya-2_small.jpg" alt="Как обойти турникеты на Ржевской" width="480" height="360" /></a></p>\r\n<p>Проходите через эту дырку и оказываетесь возле платформы Ржевская. Залезаете на нужную платформу. В сторону Станколита есть даже удобная лесенка:</p>\r\n<p><a title="Как обойти турникеты на Ржевской" href="images/wayout/Rzhevskaya-3.jpg"><img src="images/wayout/Rzhevskaya-3_small.jpg" alt="Как обойти турникеты на Ржевской" width="480" height="360" /></a></p>', '37.638464', '55.793981'),
(9601384, 2000746, NULL, '37.598675', '55.799496'),
(9601382, 2000744, NULL, '37.590095', '55.79427'),
(9600886, 2000220, NULL, '38.189332', '54.857777'),
(9600820, 2000154, NULL, '38.243741', '54.830368'),
(9600772, 2000106, NULL, '38.144324', '54.869791'),
(9601726, 2001138, NULL, '38.119387', '54.873154'),
(9601202, 2000540, '<p>Первый вагон от Москвы, спрыгиваем, идем в сторону Каширы до моста. Забор кончается минут через 5.</p>', '38.079129', '54.908862'),
(9602067, 2001881, NULL, '38.052189', '54.945136'),
(9600694, 2000028, NULL, '38.031163', '54.985809'),
(9601736, 2001149, NULL, '37.987815', '55.063287'),
