(9602266, 2002921, NULL, '38.479632', '55.17828'),
(9601220, 2000558, NULL, '38.4352002', '55.1693415'),
(9601260, 2000599, NULL, '38.41357', '55.150048'),
(9601234, 2000573, NULL, '38.378975', '55.129922'),
(9602293, 2002972, NULL, '38.3255672', '55.1019520'),
(9601826, 2001266, NULL, '38.279005', '55.092659'),
(9601208, 2000546, NULL, '38.662137', '55.266062'),
