(9601058, 2000396, NULL, '38.0921021', '55.0277422'),
(9601174, 2000512, NULL, '38.0532863', '55.0044222'),
(9600749, 2000083, '<p>Идем от платформ в сторону Москвы по левой стороне от путей, напротив здания ПЧ-32 будет калитка которая перманентно открыта, и после выходим через рынок к вокзалу (но ворота там открыты не всегда, примерно с 7:00 до 20:00), или через ворота у здания ПЧ-32 (возле автозаправки, постоянно открыты).</p>\r\n<p>На восточную часть:</p>\r\n<p>"Если вам нужно на восточную сторону Михнево, то нужно пройти по путям на платформу №3 (осторожно, на путях часто грузовые составы), и с нее подняться на лестнице на пешеходный мост.</p>', '37.960756', '55.120725'),
(9601060, 2000398, NULL, '38.025807', '55.117261'),
(9602152, 2001973, NULL, '38.095295', '55.116182'),
(9601115, 2000453, NULL, '38.165837', '55.12215'),
(9602153, 2001974, NULL, '38.213261', '55.108759'),
(9601255, 2000594, NULL, '37.896664', '55.154709'),
(9602246, 2002782, NULL, '37.840464', '55.172574'),
(9601120, 2000458, NULL, '37.794513', '55.178706'),
(9601332, 2000675, '<p>В сторону Москвы нанозабор заканчивается напротив торгового центра "Барыбино", по натоптанной тропе идти недалеко.</p>', '37.896492', '55.267838'),
(9601999, 2001778, NULL, '37.870503', '55.31137'),
(9602029, 2001827, NULL, '37.920347', '55.205894'),
(9600837, 2000171, NULL, '37.938762', '55.169083'),
(9601987, 2001765, NULL, '37.850786', '55.333469'),
(9600767, 2000101, NULL, '37.814702', '55.382474'),
(9602296, 2002975, NULL, '37.805706', '55.394671'),
(9633652, NULL, NULL, '37.7479020', '55.4726279'),
(9600811, 2000145, '<p>Нужно спрыгнуть с платформы, а затем обойти следующими способами: либо идти в сторону Взлётной и пройти через калитку и далее через гаражи (также можно пройти ещё дальше по путям), либо пойти в сторону Ленинской до строения, на стене которого красуется всеми "любимый" логотип "PID" с белой электричкой и обогнуть его (чуть раньше тоже есть калитка). Последний способ займет побольше времени.</p>\r\n<p>Нет одной секции забора под переходным мостом со стороны Промышленной улицы. </p>', '37.773381', '55.4399'),
(9602030, 2001830, NULL, '37.730899', '55.489087'),
(9601646, 2001039, NULL, '37.709416', '55.515383'),
(9600801, 2000135, '<p>Спрыгнуть в сторону Москвы, забор скоро кончится.</p>', '37.685989', '55.548407'),
(9601741, 2001156, NULL, '37.668525', '55.566133'),
(9601703, 2001110, '<p><strong>Выход в Бирюлёво Восточное</strong></p>\r\n<p>Спрыгиваем с платформы возле турникетного павильона (охране всё равно), встаём лицом к области, поворачиваемся налево и идём через пути до края насыпи, примерно по линии торца платформ. Оказавшись над выходом из перехода, принимаем левее, в 10 метрах будет тропинка вниз, в конце которой нас ждёт постоянно открытая калитка.</p>\r\n<p><br /><strong>Выход в Бирюлёво Западное</strong></p>\r\n<p>Также спрыгиваем с платформы возле турникетного павильона, встаём лицом к области, принимаем правую сторону, идём вдоль забора 30м до его конца. Внимание! Данный вариант стоит использовать с осторожностью, т.к. забор заканчивается там, где начинается довольно крутой, хоть и не высокий склон оврага.</p>\r\n<p><strong>Кликабельная пикча</strong></p>\r\n<p><a title="Как обойти турникеты на станции Бирюлёво-пассажирская" href="http://elektrichking.ru/images/wayout/Birulevo-pass.jpg"><img src="images/wayout/Birulevo-pass_small.jpg" alt="Как обойти турникеты на станции Бироюлёво-пассажирская" width="480" height="240" /></a></p>', '37.659661', '55.582974'),
(9601167, 2000505, NULL, '37.833404', '55.420836'),
(9601722, 2001133, NULL, '37.881259', '55.428792'),
(9600216, 2001305, '<p>Нужно применить дог-хелпинг, платформ-слазинг и недолгий обходинг, идти в сторону пл. Космос.</p>\r\n<p>в аэропорту с электрички действуют: обход, паровозик, билет за 22 с Космоса; с аэроэкспресса можно перелезть к электричкам по пожарным ящикам (но крутится охранник) или дождаться невнимательности охранника и пройти к торцу. <br />Однако, в автомате станции Домодедово платформы Космос нет.</p>', '37.899865', '55.414181'),
(9602125, 2001945, '<p>1</p>', '37.627319', '55.631026'),
(9601698, 2001095, '<p>В заборе к северу от станции (у дома 6 по Булатниковскому проезду) регулярно появляются вырезы. Но так же быстро их заколачивают железками. Уже почти весь забор заколочен, но дырка все равно где-нибудь есть.</p>', '37.653976', '55.592621'),
(9601656, 2001050, '<p>Выходим из метро на Каширский проезд (конечная остановка 607-ого автобуса), далее идём по нему до переезда немного на север (пересечение улицы и подъездных ж/д путей), потом по этим путям через ворота проходим к ближайшей островной платформе и залезаем на неё. Спрыгиваем с платформы, идем в сторону области, перелазим через забор справа (довольно легко).</p>', '37.622329', '55.654939'),
(9601975, 2001750, '<p>Особенностью этой станции является наличие совсем близко от платформы переезда со стороны Москвы. Это значительно упрощает обход турникетных павильонов, ибо не приходится искать никаких дырок в заборах. Плюс расстояние от платформы до переезда очень мало, не говоря уже о том, что легальную "дырку" если и заделают, то очень нескоро. Небольшая проблема в том, что платформа высоковата, девушки вряд ли осилят. </p>\r\n<p>Маршрут прост: выходя из метро, проходим мимо павильона, доходим до переезда, а от него - вдоль путей до платформ. Время такого обхода - менее пяти минут.</p>', '37.621104', '55.682026'),
(9601985, 2001763, NULL, '37.622951', '55.704032'),
(9602028, 2001825, NULL, '37.643184', '55.717501'),
(2000005, 2000005, '<p>Между пригородными и ПДС платформами есть калитка, примерно за 5 минут до прибытия и в течение 5 минут после прибытия аэроэкспресса её открывают, через неё можно пройти к пригородным платформам.</p>\r\n<p>Также с любой пригородной платформы можно спрыгнуть и перейти на платформы поездов дальнего следования (и в обратную сторону). Но это занимает 10-15 минут и обычно проще дождаться Аэроэкспресса.</p>', '37.640771', '55.729498'),
(9601671, 2001066, NULL, '37.794648', '55.739844'),
(9601856, 2001310, '<p>Рай для электричкера - можно элементарно перелезть забор, можно обойти и залезать с торцов (особенно актуально для тех, кому надо переходить на ст. Перово Казанского/Рязанского направления).</p>\r\n<p>Можно и на турникетах за кем-нибудь пристраиваться, правда, народу через Чухлинку совсем немного ездит.</p>', '37.764437', '55.733662'),
(9601835, 2001280, '<p>Калитка с московского конца новой станции Карачарово. <br />На торце новой платформы оставили деревянную лесенку - даже карабкаться не нужно.</p>\r\n<p><img src="images/wayout/Karacharovo.jpg" alt="" width="835" height="626" /></p>\r\n<p> </p>', '37.738006', '55.732618'),
(9601796, 2001230, '<p>Другая лазейка находится в начале моста через шоссе Энтузиастов в 50 метрах справа от турникетов. Ближайшая к метро южная лазейка не очень удобна (прутья измазаны солидолом + там крутой склон и можно зацепиться), зато с северной стороны достаточно перелезть низкий бетонный забор у основания моста. Далее идём к платформам и лезем на торец средней (есть треугольники, забор в этом месте частично измазан солидолом), либо идём вдоль неё к лестнице около 3 пути (будьте осторожны - там кривая и поезда проносятся близко), забираемся вверх и перелезаем через перила лестницы. Чтобы выйти - прыгаем, идём к мосту и перед ним с обоих сторон увидим лазейки. При выходе через северную (левую) лазейку будьте аккуратны, особенно зимой - там крутая горка и можно поскользнуться либо выбежать по инерции прямо на трамвайные пути. </p>\r\n<p>Третья лазейка - рядом с путями курского направления с северной стороны (в одной из секций старого бетонного забора раскрошили верхнюю часть, можно перелезть), далее переходим пути курского направления и залезаем на платформу с западной стороны. <br />Самая дальняя 4 лазейка - в сторону Москвы идёте вдоль пути "от Москвы" и там будет тропа вниз,она проходит под оторванным листом, если ещё немного пройти - выйдете к трамваю.<br />На торцах бывает ЧОП, правда почти неактивный. У турникетов охрана есть, но не много (обычно не более 5), учитывая долгую выдержку турникетов пристроиться более чем реально.</p>', '37.682191', '55.748162'),
(9601737, 2001150, '<p>Обхода турникетов есть несколько вариантов:</p>\r\n<ol>\r\n<li>Самый удобный, если вам надо к метро: проходим в дырку в заборе между обычным и "спутниковским" путем, затем спрыгиваем (Осторожно! путь со скоростным движением в кривой. Были случаи смертей) и внимательно смотрим на забор прямо перед собой: дырки там появляются и исчезают очень оперативно. Если дырок нет, забор перелезабелен.</li>\r\n<li>В сторону Кетчерской ул: спрыгиваем с московского торца и идем за платформу от Москвы. Там на стройплощадке есть ворота, они часто открыты. Можно пройти через проходную автостоянки, но отношение тамошних охранников к таким маневрам не изучено (хотя тропинка есть).</li>\r\n<li>Прочие пути: спрыгивать с торца от Москвы, идти вдоль любой стороны до нахождения места инфильтрации. Будьте внимательней при проходе в узком коридоре между двумя заборами стройплощадки: разминуться с электричкой там сложно, хотя и возможно.</li>\r\n<li>Спрыгиваем с торца платформы в сторону области и идём вдоль жд путей на Москву, через 150 - 200 м будет лестница и мы выйдем на Рассветную аллею. </li>\r\n</ol>', '37.818127', '55.744278'),
(9600931, 2000265, '<p>Просто спрыгиваете или залезаете на торцы платформы, в сторону Москвы там заборов никаких нету, в сторону области - забор с дырками (находится над путепроводом), можно обойти, если дырки сейчас заварены, можно перелезть (касается в основном тех, кто переходит на ст. Чухлинка Горьковского направления, остальным проще с торца в сторону Москвы спрыгивать и спокойно выходить.</p>\r\n<p>Можно пройти и через турникеты паровозиком, стоит как правило всего один охранник.</p>', '37.764199', '55.735743'),
(9601186, 2000524, NULL, '37.774484', '55.730782'),
(9601964, 2001445, '<p>С платформы на Москву можно без труда перелезть через забор, также есть перелаз около входа в подземный переход.</p>\r\n<p>Пройти за кем-то легко, на турникетах только по 1 охраннику, да и то не всегда. Но здесь есть небольшой минус - вечером от Москвы поток пассажиров небольшой, можно долго ждать человека с билетом, чтобы за ним пройти.</p>\r\n<p>Обход турникетов: подходя к подземному переходу со стороны метро, поворачивайте налево и идёте вдоль забора 50м. Возле стоянки автобусов забор заканчивается, заворачиваете и по путям возвращаетесь на платформу.  </p>', '37.798949', '55.722155'),
(9601627, 2001000, '<p>Пожалуй, самая затурникеченная станция в России. Единственная более-менее возможность обойти - из метро идёте по подземному переходу к третьей платформе, идёте к забору между двух выходов из перехода у турникетного павильона, ближе к выходу с перехода, что подальше от турникетного павильона забор чист от колючей проволоки на данный момент, там и перелезаете. При приезде в Москву из области на 1-ую платформу можно спрыгнуть возле последнего вагона, пройти по путям в сторону области и перелезть через забор к метро, но это небезопасно и лезть придётся примерно 3м.</p>\r\n<p>Так же, в связи с последними изменениями стал доступен еще один способ. Под спутник теперь отдельный турникетный проход, на котором как правило стоит всего 1 охранник.</p>\r\n<p><strong>Самый удобный вариант - паровозик!</strong></p>', '37.816883', '55.716218'),
(9601635, 2001019, '<p>У края платформы ближе к Москве забор отсутствует, спрыгиваете с платформы и идёте к Лермонтовскому проспекту. Влезть на мост крайне легко. </p>\r\n<p>Ещё в середине платформы "На Москву" из-за сварки забора есть своеобразные "ступеньки".</p>', '37.847565', '55.705827'),
(9601152, 2000490, '<p>С Московского торца сразу за платформой "на Москву" есть полулегальный переход через пути.</p>', '37.865016', '55.698408'),
(9601642, 2001030, '<p>Существуют несколько вариантов обходинга. Можно пройти в сторону вокзала и за мостом перелезть через забор; дырка слева перед мостом заделана, и на заборе там висит колючка. (Впрочем, дырку время от времени восстанавливают, т. к. она расположена исключительно удобно). При отсутствии колючки там можно легко перелезть.</p>\r\n<p>Также за мостом, со стороны трамвайной конечной, всегда можно найти лазейки (правда, время обхода может увеличиваться почти неограниченно), а ещё можно залезть на пешеходный мост (у конца платформы, ближайшего к области) или по другую сторону от железки перелезть через забор.</p>\r\n<p>Будьте осторожны, залезая на островную платформу возле 3-го пути (где спутники и ПДСы), говорят, там часто сбивают людей, а также по вечерам встречаются быдланы. </p>', '37.721612', '55.750411'),
(9601991, 2001770, '<p>Платформа 1, конец в сторону области. Там лестница, через перила и вы на свободе. Также пока ещё можно спрыгнуть с московского торца и по тропинке, пока забор до МЦК не продлили.</p>', '37.740898', '55.744544'),
(2000003, 2000003, '<p>Турникеты - новые высокие, у турникетов в часы пик обычно 2-3 охранника, поэтому перепрыгнуть и не оказаться остановленным нелегко, в другое время они стоят по одному.</p>\r\n<p>Обход турникетов довольно долгий. Осуществляется через платформы ПДС, занимает порядка 10 минут. Однако можно спрыгнуть с платформы за кассой на выход, залезть на платформу "спутников", спрыгнуть с неё и залезть на ПДСную платформу, где турникетов уже нет :) Помешать этому варианту могут ПДСы и охранники (одного охранника достаточно, чтобы заблокировать проход), а помочь - открытые двери в заборах (вероятность, что одна из них открыта - 40%). Можно также перелезть через ворота, что находятся около турникетов (кажется, никем не практикуется, слишком близко к турникетам).</p>\r\n<p>Ещё существует интересный вариант: перелезть через один забор между турникетным павильоном и магазином, а под вторым подлезть (по чьему-то недосмотру там в двух местах под заборами ближе к путям достаточно места для пролезания, а на заборах напротив этих наверху не колья, а закруглённые навершия), как ни странно, особо это ни кем не палится. Также очень удобно (хотя временами стоят менты) лазить через ворота возле 17-го пути (бывают немного обсолидолены) и оттуда проникнуть на платформу (если на пути стоит собака, можно лезть прямо по ней, если нет - по тупику).</p>\r\n<p>И последний вариант: обход через платформу за 17-м путём, тут возможны разные подварианты: спрыгнуть с парапета (естественно, действует только на выход), а также иногда бывают открыты ворота и калитка рядом со зданием вокзала.  <br /><br />При обходинге в сторону Новорязанской улицы (по правую руку, если смотреть от тупиков вокзала) в заборе дыра. </p>', '37.657909', '55.773941'),
(9601647, 2001040, '<p>Выходите из метро, перед мостом под станцией поворачиваете налево, и через 50м можно залезть на неиспользуемую 2-ую платформу по дыркам в столбе электрификации. Затем спрыгиваете со 2-ой платформы и по путям переходите на действующую 1-ую платформу. <br /><br /></p>', '37.705088', '55.781358'),
(9601636, 2001020, '<p>Спрыгнуть сплатформы и перейти пути налево (от москвы если ехать), скоро забор заканчивается, перелезть через небольшое заборчик, и пройти в сторону рынка. Там выйти через калитку, вроде всегда открыта. ВНИМАНИЕ! Время от времени у конца забора с невидимой стороны тусуются менты и ловят за переход жд-путей! </p>\r\n<p>Ещё есть какая-то домофонная дверь (на другой стороне железной дороги), не знаю, позвоните, может откроют. Можно также пройти через турникеты (1 охраник и бабушка у калитки, но далеко не всегда). Переход с платформы на платформу вообще свободный (что радует, т. к. станция узловая и нередко приходится пересаживаться с одной ветки на другую), кроме спутниковой платформы - там дополнительная линия турникетов.</p>\r\n<p>Хорошее место для обхода - со стороны Москвы с севера, прямо к рыночку, через него на Инициативную улицу. Препятствие - заборчик, который очень легко перелезть.</p>', '37.897353', '55.682186'),
(9601919, 2001390, '<p>Еесли идти на восток, то забор почти сразу кончится.</p>', '37.923697', '55.668565'),
(9601822, 2001260, '<p>В сторону Рязани справа забор кончается, просто обходим его и залезаем (аналогичен и обратный вариант - спрыгиваем и обходим забор). Можно пройти и через турникеты, стоит как правило всего один охранник.</p>\r\n<p>В сторону Москвы забор тоже короткий.</p>', '37.954625', '55.655269'),
(9602033, 2001835, NULL, '37.98242', '55.64996'),
(9601758, 2001180, '<p>Спрыгиваем у первого вагона из Москвы, затем нужно пройти немного в сторону Удельной и забор скоро закончится. Даже при всем желании, эти заячьи тропы (обходы) цппк не заделает никогда. </p>', '38.007815', '55.645377'),
(9601915, 2001385, '<p>Кто знает, сообщите :-)</p>', '38.044441', '55.634723'),
(9601760, 2001182, NULL, '37.932701', '55.672691'),
(9600954, 2000288, NULL, '38.000474', '55.668106'),
(9601769, 2001193, NULL, '38.033729', '55.664757'),
(9602225, 2002092, NULL, '38.068118', '55.655764'),
(9601793, 2001227, NULL, '38.111749', '55.64799'),
(9601801, 2001236, NULL, '38.175228', '55.638649'),
(9600999, 2000333, NULL, '38.201705', '55.637045'),
(9601838, 2001284, NULL, '38.276137', '55.635782'),
(9601762, 2001184, NULL, '38.314939', '55.628617'),
(9601786, 2001218, NULL, '38.35208', '55.628157'),
(9602231, 2002099, NULL, '38.389025', '55.625489'),
(9601644, 2001032, NULL, '38.447721', '55.608827'),
(9601739, 2001152, NULL, '38.503995', '55.603763'),
(9601842, 2001291, NULL, '38.545196', '55.603829'),
(9601723, 2001134, NULL, '38.61176', '55.599363'),
(9601337, 2000684, NULL, '38.69141', '55.590093'),
(9601776, 2001203, NULL, '38.755402', '55.581464'),
(9601843, 2001293, NULL, '38.823362', '55.572035'),
(9601738, 2001151, NULL, '38.413711', '55.614718'),
(9600921, 2000255, '<p>Станция затурникечена крайне слабо,можно легко попасть на платформу,если перелезть через легкий 3х-секционный забор со стороны Москвы или прямо около турникетного павильона. Влезть на островную платформу тоже не составит особых проблем. На московском торце есть легальный настил.</p>', '38.071317', '55.626522'),
(9601929, 2001405, '<p>Заборы вдоль платформы можно обойти с любой стороны и перелезть в любом месте. Залезать с торцов сравнительно легко, но в 1 из 100 случаев из турникетного павильона может появиться быдлан и попросить (вполне вежливо) здесь не лезть.</p>\r\n<p>Желающие миновать турникеты, но пройти по тоннелю могут залезть/слезть через дырку возле начала пандуса. Таким образом, лезть на платформу/спрыгивать придётся всё равно, но можно, скажем, спрятаться от дождя.</p>', '38.100727', '55.616281'),
(9602223, 2002090, '<p>Спрыг с московского торца и обход высокого забора в сторону города и на противоположную (в случае последней, если сразу забраться наверх для вас слишком круто, можно пройти 100 метров в сторону Москвы и пройти нормально). На платформе спутников (которая, к слову, ещё и ниже платформы обычных собак) есть удобная лестница на всё том же московском торце.</p>', '38.13622', '55.601764'),
(9601438, 2000805, NULL, '38.159769', '55.592177'),
(9601504, 2000875, NULL, '38.183714', '55.582356'),
(9600961, 2000295, '<p>С обеих торцов платформы забор тянется крайне недолго, спрыгнуть с платформы или залезть на нее больших трудов не составляет. Если кому надо в сторону фабрики, можно воспользоваться неотурникеченной платформой по крайнему слева в сторону Рязани пути.</p>', '38.208087', '55.572283'),
(9601841, 2001290, '<p>Банальный перелазинг забора на платформе спутников либо немного пройти в сторону Москвы, забор быстро кончится.</p>', '38.225423', '55.565443'),
(9601197, 2000535, NULL, '38.238929', '55.560455'),
(9600770, 2000104, NULL, '38.29457', '55.540574'),
(9601690, 2001087, NULL, '38.33774', '55.51457'),
(9601978, 2001755, NULL, '38.363414', '55.498611'),
(9601707, 2001116, NULL, '38.422798', '55.473945'),
(9602006, 2001785, NULL, '38.449656', '55.46163'),
(9601324, 2000665, NULL, '38.400604', '55.482972'),
(9602276, 2002955, NULL, '38.495849', '55.445011'),
(9601194, 2000532, NULL, '38.525686', '55.435268'),
(9602075, 2001890, NULL, '38.560429', '55.426843'),
(9601634, 2001009, NULL, '38.656276', '55.405309'),
(9601903, 2001371, '<p>Спрыгнуть в конце платформы, и обойти забор, который тут же и кончается. При выходе на платформу в сторону Москвы действовать также. На турникетах обычно весь день 1-2 охранника, по вечерам часто стоят менты в начале платформы у моста.</p>', '38.685772', '55.32704'),
(9633647, 2002002, NULL, '38.685795', '55.366701'),
(9601716, 2001125, '<p>Рядом с Минусинской заканчивается забор, правда идти надо параллельно железной дороги в сторону области (не ближний свет и не почищено скорее всего...там еще остановка общ.транспорта рядом есть).</p>\r\n<p>Второй путь спрыгнуть в сторону Москвы и идти параллельно и в конце Анадырского этот путь кончается и есть проход между гаражами (был раньше по крайней мере)</p>', '37.683928', '55.86288'),
(9600831, 2000165, '<p>Важно знать: платформа в сторону Москвы на удивление высокая, запрыгнуть с земли смогут не все. Вариантов обхода over 9000:</p>\r\n<ul>\r\n<li>Через 170 метров с мытищинской стороны будет легальный переход через жд-пути;</li>\r\n<li>Ворота возле мытищинского края платформы на Москву, ведущие на Анадырский проезд, частенько открыты, от них до края платформы - три метра;</li>\r\n<li>Московский торец: спрыгиваем, обходим торец платформы на Мытищи - всё, вы на свободе! Можете идти к официальному входу на платформу с турникетами и расписанием. Способ хорош, если надо в район Ярославский;</li>\r\n<li>Со стороны Анадырского проезда (Лосиноостровский район) аккурат напротив остановки "Анадырский проезд, 57" за гаражами есть чудесная дыра в заборе;</li>\r\n<li>Поднявшись на первый лестничный пролёт моста со стороны Анадырского проезда, можно спрыгнуть на платформу, забор там примерно по колено. В обратную сторону осуществимо с трудом.</li>\r\n</ul>', '37.710972', '55.880286'),
(9600841, 2000175, '<p>С александровской платформы спрыгиваем с александровского торца, перелезаем на соседнюю неиспользуемую платформу, далее на мост (кому надо оказаться на левой стороне), либо на платформу не лезем, проходим 50 метров вдоль пути - и в дырку в заборе (для тех, кому направо). Залезть проще всего через забор. С московской платформы спрыгиваем с александровского торца, и прямо сразу будет настил - один из самых простых обходов на всем мосузле!</p>', '37.726198', '55.89017'),
(9601001, 2000335, '<p><img title="Как обойти турникеты в Тайнинской" src="https://pp.userapi.com/c631628/v631628222/10777/NIv9EQQLy8I.jpg" alt="Как обойти турникеты в Тайнинской" width="604" height="443" /></p>', '37.742297', '55.900778'),
(2000002, 2000002, '<p>Выходим из метро и входим в Ярославский вокзал через главный вход (не с торца), по указателю на выход к поездам дальнего следования. Проходим досмотр и выходим к платформам ПДС.  Далее вариантов несколько: </p>\r\n<h5>Ворота</h5>\r\n<p>Платформы ПДС и экспрессные отделяют между собой высокие ворота. Они довольно удобны, чтобы их перелезть. В результате попадаете на платформу для экспрессов, а оттуда уже можно спрыгнуть и с помощью догхелпинга попасть на пригородные платформы. <br />Вариант довольно удобен, но ВНЕЗАПНО из павильона может прибежать быдлан, которого можно опустить / зачмырить и он уйдёт. Не стоит бояться быдла - они охраняют турникеты и больше 10-15 секунд на вас не потратят! </p>\r\n<h5>Догхелпинг</h5>\r\n<p>Самый удобный вариант для тех, кому нужно попасть на пригородные платформы. Спрыгнуть с платформы и с помощью догхелпинга попасть на экспрессную платформу, а затем также с помощью догхелпинга попсть на пригородные. См. выше про быдлонов. Также охранник в часы-пик стоит на этом спуске.</p>\r\n<h5>Экспресс</h5>\r\n<p>Беспроигрышный вариант для тех, кому нужен экспресс. Пройти по экспрессной платформе до конца экспресса, спрыгнуть и с помощью догхелпинга попасть на экспрессную платформу. </p>\r\n<h5>ПДС</h5>\r\n<p>Самый неудобный и долгий, зато стопроцентный вариант, универсальный для всех вокзалов этой страны - платформы дальнего следования. Проходите их до конца, спрыгивайте и по путям переходите на пригородные платформы. </p>\r\n<h5>Лайфхак</h5>\r\n<p>Ну и небольшой лайфхак. РЭКСы до Пушкино и Болшево не проверяются. Попасть на платформу для экспрессов гораздо быстрее, нежели на пригородные. Если по времени подходит РЭКС, то пользуйтесь вариантом обхода для экспрессов, садитесь на РЭКС и в Мытищах / Пушкино пересаживайтесь на обычную элку, возможно, вы даже обгоните ту элку, на которую не успели на вокзале.</p>\r\n<h5>Выход без билета</h5>\r\n<p>В тоннеле на паровозик охране по фигу! Смело паровозьте! Но если по каким либо причинам паровозить неудобно, то выходите из последнего вагона и идёте по путям до ПДСных платформ. Там есть удобная лесенка, поднимайтесь и выходите.</p>', '37.657227', '55.777637'),
(9601018, 2000355, '<p>На станции две платформы, одна с турникетами, другая без. Если приехали на отурникеченную - идём к концу платформы в сторону Москвы, спрыгиваем, заходим на другую платформу по лестнице. Выход осуществляется через мост и теоретически возможен контроль на входа на него (иначе зачем закрывать одну из двух лестниц, ведущих к бестурникетной платформе с моста?), но в жизни автором замечен не был.</p>\r\n<p>Более быстрый способ - спрыгиваем со стороны области, идём направо через пути и спокойно выходим в парк и к лестнице, ведущей на мост - никакого забора нет. На пути будет несколько грузовых вагонов - обходим их с правой стороны, в 10 метрах за мостом вагоны заканчиваются вместе с рельсами. Возле вагонов обычно тусуются ребята в форме, но это складские работники и охранники, зайцы их не интересуют.</p>\r\n<p><span style="color: #ff6600;">Только аккуратнее с переходом путей. Если прибыли со стороны области - не идите, покуда собака не уехала. Она полностью закрывает вид в сторону Москвы, откуда может на полной скорости пилить ПДС или экспресс.</span></p>', '37.651575', '55.801863'),
(9601882, 2001345, '<p>Выход у северного торца Московской платформы заварен. Обходить нужно через парк Сокольники. <strong>Будьте внимательны: много поездов и ограниченный обзор.</strong></p>\r\n<p>Есть ещё один вариант: с платформы "на Москву" выходим из последнего вагона и вылезаем под платформой. Зимой скользко, а так очень удобно.</p>', '37.662896', '55.814121'),
(9601236, 2000575, NULL, '37.671182', '55.828974'),
(9601217, 2000555, '<p>Спускаетесь с любой платформы и идёте около 150 метров в сторону области. Выйти можно как на восток, так и на запад. </p>', '37.67072', '55.844007'),
(9601805, 2001240, '<p>Самая неудобная станция в плане обхода. Единственный оптимальный вариант - паровозик.</p>', '37.567614', '55.882475'),
(9600851, 2000185, '<p>Обход через переход с московского торца.</p>', '37.553465', '55.897254'),
(2000009, 2000009, '<p>Около Стардогса прыгаем на рельсы, идем прямо вдоль бетонного забора, поворачиваем к платформе Савёловская и пролезаем сквозь забор, спускаемся в переход и идем в метро.</p>', '37.588111', '55.794391'),
(9602463, 2003965, '<p><span style="color: #ff6600;">На торцах платформ установлены треугольники.</span></p>\r\n<p><strong>Вариант 1</strong></p>\r\n<p>Лучше всего турникеты обходить с юга станции. Иногда в часы пик на краях платформы дежурят ЧОПовцы, мешая электричкерам забраться. Периодически край платформы мажут солидолом - следует быть аккуратным, возможно запачкать одежду. Ещё есть вариант прямо с платформы у турникетного павильона спрыгнуть в переход, который ведёт в метро, но там сейчас подзаварили и прыгать придётся высоко + народу уйма там ходит, можно неудачно приземлиться. С севера станции турникеты обходить очень долго, более того, путь может сопровождаться крысами. </p>\r\n<p><strong>Вариант 2</strong><br /><br />Приехал из области, дошёл до северного конца платформы (последний вагон), спустился, немного прошёл вдоль забора и увидел большую дыру (кажется, целой секции нет), вышел, вернулся к метро. Да, немного дольше идти, но это компенсируется комфортом: перекладина забора образует ступеньку, т.е. не надо ни прыгать, ни садиться =&gt; можно использовать в любой одежде и обуви. Пару раз я так с чемоданом выходил. <br />P.s. На вход таким путём тоже препятствий не вижу, надо будет попробовать.</p>', '37.575358', '55.820048'),
(9601830, 2001270, '<p>Обходинг есть только в сторону юга и метро , в сторону мцк все изрыто. По насыпи со стороны метро и дальше по перилам на платформу.</p>', '37.574453', '55.846447'),
(9601117, 2000455, NULL, '37.573166', '55.865816'),
(2000008, 2000008, '<p>Есть два способа попасть на Рижский Вокзал без билета (ровно как и выйти с него):</p>\r\n<ol>\r\n<li>Перелезть через забор слева от турникетного павильона. Забор без колючки, без пик точёных и прочего - будто специально создан для перелезания. Не стоит делать этого, если на тебя смотрят, ибо тогда этот чудо-залаз скоро прикроют.</li>\r\n<li>Обойти через конечную автобусов и троллейбусов у Крестовского моста. Маршрут "на вход": встать лицом к турникетному павильону, обходить вдоль шоссе на север (справа от вас должен вверх уходить мост), в конце дороги слева будет стоянка автобусов, пройти туда и увидите выход на платформу. "На выход": спуститься с бестурникетного конца платформы и выйти через калитку.</li>\r\n</ol>\r\n<p>Кликабельная схема:</p>\r\n<p><a title="Как обойти турникеты на Рижском вокзале" href="images/wayout/Riga.jpg"><img src="images/wayout/Riga-small.jpg" alt="Как обойти турникеты на Рижском вокзале" width="480" height="266" /></a></p>', '37.632957', '55.794213'),
(9600901, 2000235, '<p>Есть два способа обойти турникеты на Дмитровской:</p>\r\n<p><a title="Как обойти турникеты на Дмитровской" href="http://elektrichking.ru/images/wayout/Dmitrovskaya.jpg"><img src="images/wayout/Dmitrovskaya_small.jpg" alt="Как обойти турникеты на Дмитровской" width="480" height="288" /></a></p>\r\n<ol>\r\n<li>Выходим из западного выхода метро (первый вагон из центра, далее налево и прямо); <br />Проходим зелёный пешеходный тоннель, после него смотрим направо; Забираемся на бетонную "насыпь". Если нужно в область - смотрим направо, находим скобу на заборе, с её помощью забираемся на областную платформу. Если нужно в сторону курка: смотрим прямо, перелезаем метровый забор, <b>смотрим по сторонам на предмет наличия поездов</b>, переходим их, и по бетонному устою вокзальной платформы забираемся на неё.</li>\r\n<li>Выходим из восточного выхода метро (первый вагон из центра, далее направо и ещё раз направо); Идём прямо (в сторону вокзала), доходим до конца нано-забора, обходим, идём порядка 250 метров в обратную сторону; Залезаем на нужную нам платформу. На вокзальную платформу залезть просто - бетонный выступ на метровой высоте, на областную чуть сложнее: <br />Для выхода повтори инструкцию в обратном порядке. смотрим направо, находим скобу на заборе под торцом платформы, с её помощью забираемся на областную платформу. <br /><br /><b>Электричкер, помни! При обходинге вдоль путей всегда будь предельно внимателен! Сними капюшон и наушники, смотри по сторонам и имей ввиду, что поезд может запросто приехать по неправильному пути.</b> </li>\r\n</ol>', '37.578562', '55.808007'),
(9601934, 2001410, NULL, '37.553774', '55.805353'),
(9601947, 2001425, NULL, '37.526368', '55.815512');
INSERT INTO `#__rw2_old` (`yandex`, `express`, `detour`, `lt`, `lg`) VALUES
(9601688, 2001085, '<p>Со стороны ст.м. Войковская (ближе к Рижскому) пролезаем под забором (или перелезаем его. Учтите, он был обсолидолен), со стороны Сокола (где троллейбус поворачивает) есть большая дырка.</p>\r\n<p>Когда нет дождя или снега, можно залезть на мост возле турникетного павильона. Делать это нужно осторожно - смотри схему 2.</p>\r\n<p>Кликабельные схемы:</p>\r\n<p><a title="Как обойти турникеты на Ленинградской" href="http://elektrichking.ru/images/wayout/Leningradskaya-1.png"><img src="images/wayout/Leningradskaya-1_small.png" alt="Как обойти турникеты на Ленинградской" width="480" height="186" /></a></p>\r\n<p><img title="Схема 2" src="images/wayout/Leningradskaya-2.png" alt="Как обойти турникеты на Ленинградской" width="448" height="254" /></p>', '37.498881', '55.814986'),
(9601251, 2000590, NULL, '37.476693', '55.814211'),
(9600741, 2000075, '<p>Обходинг довольно простой: слезаем с московского (дальнего от метро) торца платформы. Справа будет забор метров на 300. Рядом с платформой он весь вареный-перевареный, легко перелезабельный, иногда дырявый. Если дырки нет, и перелезть не можете, то обойдите его - он не очень длинный. Как попали за забор, идите обратно вдоль платформы, и уткнетесь во вход в метро. <br /><br />Также в обе стороны забор кончается, да и в нем в сторону МСК достаточно дыр.</p>\r\n<p>Кликабельная схема:</p>\r\n<p><a title="Как обойти турникеты в Тушино" href="http://elektrichking.ru/images/wayout/Tushino.jpg"><img src="images/wayout/Tushino_small.jpg" alt="Как обойти турникеты в Тушино" width="480" height="222" /></a></p>', '37.442125', '55.826848'),
(9602036, 2001840, NULL, '37.398919', '55.83316'),
(9602460, 2003960, '<div class="wk_sub_sub_header"><strong>Перелазинг</strong></div>\r\n<p>Примерно посередине станции есть забор с множеством горизонтальных прутьев, через которые легко перелезть. Его хорошо видно с платформы, если смотреть на север.</p>\r\n<div class="wk_sub_sub_header"><strong>Обходинг</strong></div>\r\n<p>Если вам нужно на запад, к Железнодорожной улице или улице Чайковского, то можно просто спрыгнуть с платформы и идти на запад около 160м, забор кончится с обеих сторон.</p>\r\n<p>Кликабельная схема:</p>\r\n<p><a title="Как обойти турникеты в Павшино" href="http://elektrichking.ru/images/wayout/Pavshino.jpg"><img src="images/wayout/Pavshino_smalljpg.jpg" alt="Как обойти турникеты в Павшино" width="480" height="204" /></a></p>', '37.340223', '55.814996'),
(9601142, 2000480, '<p>Так как забор присутствует только на платформе, обойти турникеты проще простого: достаточно спрыгнуть с любого торца и идти в нужном вам направлении. Аналогично из залазом. У московского торца есть наземный переход, так что есть вариант обойти, не нарушая ничего.</p>', '37.303141', '55.814745'),
(9601364, 2000720, '<p>Обход, по сути, везде, ибо забор есть только на платформе. А у областного торце есть даже наземный переход.</p>', '37.246738', '55.823366'),
(9601770, 2001194, NULL, '37.21978', '55.832049'),
(9601122, 2000460, '<p>Можно дошагать до переезда, он расположен в 250 метрах от областного конца платформ. Также, если спрыгнуть и идти в сторону Москвы, то забор быстро кончится (метров 100-150).</p>', '37.184144', '55.841735'),
(9601748, 2001164, NULL, '37.155077', '55.855109'),
(9600871, 2000205, '<p>Можно сделать платформ-джампинг с московского торца и идти к ж/д переезду, но это довольно долго, на глаз метров 200. Проще спрыгнуть с того же торца и пройти через дыру в заборе в сторону города; дыра рядом с торцом.</p>\r\n<p>Можно пройти через калитку, находиться она примерно по центру платформы, рядом с путём, идущим в область. Московский торец платформы оборудована довольно удобной системой залазинга, но дог-хелпинг всё-таки лучше.</p>\r\n<p>Те, кому надо в район Вокзальной улицы, могут спрыгнуть с шаховского торца, пройти немного вперед и повернуть налево, по полузаброшенной ж/д линии на бывший ДХПФ. Там еще непонятно зачем стоит два или три ряда p/dозабора, каждый без одной секции; причем видно, что так было изначально </p>', '37.12567', '55.866576'),
