(9601923, 2001395, '<p>Обход со всех сторон. Наиболее удобный - справа от павильона (в сторону Шахи). Торчит мальнький кусок арматуры, который можно юзать как ступеньку. Обычно еще дощечка стоит.</p>\r\n<p>Вообще обход со всех сторон, станция-дырка.</p>', '36.856383', '55.903739'),
