(2000007, 2000007, '<p>Обход через аэроэкспрессную, либо ПДС-ную платформу. Эти платформы имеют отдельный выход из метро. Калитки на торцах обычно открыты, есть легальный переход через пути. Также стоит учесть, что довольно часто электрички приходят на неотурникеченные ПДС-ные платформы. В этом случае у выхода из подземного перехода стоят быдланы (вроде бы их можно обойти с калужского торца платформ).</p>\r\n<p>На турникетах быдланов уже достаточно, также могут перекрывать наиболее быстрый аэроэкспрессный путь обхода, иногда тусят на торцах возле калитки. Пофигистичны.</p>', '37.56214', '55.741976'),
(9601666, 2001060, '<p>Обход со стороны Московского торца. Спрыгнуть и держаться левее, пока не закончится забор.<br />С областного надо идти, держаться левее и завернуть за бетонный забор.</p>\r\n<p>Оба способа работают как в одну, так и в другую сторону.</p>', '37.550071', '55.773155'),
(9601349, 2000700, NULL, '37.531622', '55.754214'),
(2000006, 2000006, '<div class="wk_sub_header"><strong>Калитка</strong></div>\r\n<div class="wk_sub_header">Спрыгиваем с платформ в сторону Беговой, проходим 150 метров, держась забора справа. В нем будет калитка. Очень редко бывает закрыта.<br />P.S. В последнее время закрыта.</div>\r\n<div class="wk_sub_header"> </div>\r\n<div class="wk_sub_header"><strong>Аэроэкспресс</strong></div>\r\n<div class="wk_sub_header">Дожидаемся прихода аэроэкспресса, ворота открываются, выходим. С недавних пор пассажиров аэроэкспресса выпускают через калитку рядом с метро Белорусская.</div>\r\n<div class="wk_sub_header"> </div>\r\n<div class="wk_sub_header"><strong>4 платформа 6 путь</strong></div>\r\n<div class="wk_sub_header"><strong><em>Способ подходит только если нужно попасть на отурникеченную платформу, а не в обратную сторону. </em></strong><br />Если на этой платформе стоит электричка, используем догхэлпинг. Доходим до турникетного павильона, спрыгиваем на пути. Подходим к электричке и по поручням забираемся на платформу. Не заденьте концевой кран! <br /><br /><strong>Забор у перехода<br /></strong>Рядом с 6 платформой 1 путь есть переход. Рядом с ним на заборе отсутствуют пики. Удобно перелезать. </div>\r\n<div class="wk_sub_header"> </div>\r\n<div class="wk_sub_header"> </div>\r\n<div class="wk_sub_header"><img src="images/wayout%2FBelorusskiy.jpg" alt="" width="1003" height="640" /></div>', '37.580015', '55.776824'),
