(9601539, 2000912, '<p>Можно спрыгнуть с торца платформы (в сторону Владимира) и перелезть низенькие перила у начала лестницы, ведущей на кольцевое направление (3-я платформа). Так же можно спрыгнуть с московского торца платформы, около платформы на Москву есть дырка - если влезаете, то вперёд, если нет - то идёте в сторону Москвы до двери в заборе рядом со зданием.</p>\r\n<p>Можно перелезть через забор недалеко от касс на выход (2-ая платформа, от Москвы), в районе 7-ого - 8-ого вагонов (в сторону Москвы, 1-ая платформа) имеется выход в город - через забор (подсказка - лестница перехода). Для экстремалов - в конце платформы "на Москву", залезаете возле плаката на ограждение, смотрите в сторону торгового комплекса Мигеко, внизу будет какой-то склад и забор - идёте по нему, а в конце спрыгиваете.</p>', '38.976089', '55.795849'),
(9602107, 2001925, '<p>Торец на Москву, с правой стороны в заборе дырка.</p>', '39.005248', '55.811137'),
(9601734, 2001147, NULL, '39.064409', '55.843153'),
(9600796, 2000130, '<p>Лазеек дохренища - можно подняться по лесенке и легко перелезть забор. Есть дырка со стороны Москвы со стороны Комсомольской улицы. Также есть лазейка в заборе у торца 1 вагона в сторону области - пролезаем через дыру, дальше с помощью забора забираемся на край платформы, и дальше либо боком, либо перелазим забор самой платформы. В самих заборах с обоих сторон также есть дырки. В сторону области забор довольно быстро заканчивается, так что нелюбителям лазать через заборы можно вполне обойти. <br /><br />Постоянно открытая калитка в сторону области. Рекомендуется для тех, кто идет в сторону метро Новокосино. Высота платформы примерно 1.50 м. Бывали случаи трамватизма. Сама калитка находится в 50 метрах от платформы в сторону Владимира <br /><br />Справа от первой платформы вместо забора с дырами поставили из профлиста. Но есть лазейка на первой платформе со стороны города. Справа от магазина золотая рыбка у забора нет одной верхней секции, перелаз вполне безопасен. Но не рекомендую его юзать в дождь. Также есть лазейки со стороны Дзержинского если пройти немного в сторону Москвы.</p>', '37.859451', '55.752281'),
(9601177, 2000515, NULL, '37.897669', '55.759899'),
(9601902, 2001370, NULL, '37.923226', '55.757651'),
(9601767, 2001190, NULL, '37.955255', '55.752129'),
(9600835, 2000169, NULL, '37.862611', '55.780303'),
(9601665, 2001059, NULL, '37.918981', '55.805704'),
(9602120, 2001940, NULL, '37.949825', '55.810113'),
(9601675, 2001070, '<p>Сейчас удобные лазейки в задней части 1 платформы (от Москвы) и за ней были заварены и затянуты колючей проволокой типа "егоза", поэтому обход весьма долог. Но со стороны Владимира проход через автостоянку открыт.</p>\r\n<p>Самый быстрый способ выйти в город минуя турникеты - зайти на пешеходный мост напротив здания вокзала, перейти на противоположную сторону (север) и далее перелезть через перила в нижней части лестницы, после чего держась за них пройти по краю лестницы с внешней стороны. Чтобы попасть на южную сторону города, надо ещё раз пройти по другому пешеходному мосту чуть западнее. Вход на станцию - в обратном порядке. Обойти можно и по путям, но на обход времени уйдёт куда больше (до конца забора в сторону Москвы - полкилометра, до места где можно перелезть бетонный забор сразу в город не попадая на частную территорию складов - порядка 300 метров). </p>\r\n<p>В Железке стоят турникеты нового типа, раздвинуть их уже сложно, пристроиться легче.  У платформы спутников свой турникетный павильон, по утрам там много ЧОПа. Залезть на неё проще всего по мордам стоящих электричек, но по утрам быдло этому активно может препятствовать. Также можно залезть с торца со стороны Владимира.</p>', '38.008851', '55.752306'),
(9601301, 2000640, NULL, '38.059657', '55.753183'),
(9633651, 2002000, NULL, NULL, NULL),
(9601192, 2000530, NULL, '38.120404', '55.753292'),
(9600773, 2000107, NULL, '38.15304', '55.744276'),
(9601867, 2001325, '<p>Средняя степень сложности. Турникеты охраняются с двух сторон в часы пик, а обычно стоит одна женщина. Паровозинг прокатывает на "ура".</p>\r\n<p>Так же имеются лазейки в заборе по середине платформы по левую сторону при движении из Москвы. Так же можно пройти ~70 метров в сторону Владимира и наткнуться на дыру в заборе со стороны автовокзала. Слаз не контроллируется, особенно в часы пик, когда идёт целая толпа.</p>\r\n<p>В обычное время, очень редко, на торце стоит одинокая тётенька, которая никак не реагирует на залезающих.</p>', '38.202436', '55.730043'),
(9601631, 2001006, NULL, '38.291097', '55.722226'),
(9602038, 2001845, NULL, '38.347314', '55.720981'),
(9601783, 2001212, NULL, '38.378535', '55.720313'),
(9601680, 2001076, '<p>Для опытных электричкеров эта станция не составляет большой проблемы, так как на ней пересаживается на автобусы/маршрутки дофига народа в Ногинск и Электросталь, охрана дежурит там чуть ли не постоянно. Впрочем, график у них какой-то странный, неизвестно есть ли он вообще.</p>\r\n<p>Есть отличная лазейка: под мостом, на северной стороне станции (откуда автобусы ходят до Стали и Ногинска) есть дырка. Пролазим через неё, перелезаем через перила моста - это несложно. Также чуть ли не каждый день появляется дырка в заборе около турникетного павильона (с южной стороны), но так же часто она и заваривается.</p>\r\n<p>Способ для особо ленивых и любящих прогуляться: забор заканчивается на повороте Фрязевского шоссе, спрыгнув с платформы, можно его тупо обойти. Но это занимает дохрена времени.</p>', '38.46548', '55.732365'),
(9601782, 2001211, NULL, '38.573865', '55.756681'),
(9601653, 2001047, NULL, '38.629893', '55.769397'),
(9601721, 2001132, NULL, '38.468788', '55.768282'),
(9601112, 2000450, NULL, '38.46093', '55.786755'),
(9601319, 2000660, NULL, '38.454543', '55.801182'),
(9601939, 2001415, '<p>На турникетах иногда быдлосы и крутятся, но с Захаровского торца платформы (она там одна из-за однопутки) обойти крайне легко. Ахтунг: московский торец платформы бывает обсолидолен!</p>', '38.44408', '55.850897'),
(9601712, 2001121, NULL, '38.4678570', '55.8729648'),
(9601872, 2001330, '<p>Всегда была и будет лазейка в конце платформы в сторону Петушков. Там в заборе всегда есть разогнутые прутья, можно выйти через какую-то никому не нужную территорию прямо в центр города.</p>\r\n<p>Также есть и способ для ленивых: кому всё равно в ту сторону, может прогуляться до переезда по железнодорожным путям, спрыгнув с платформы и направившись в сторону Москвы. Кроме того, на станции гуляют злые менты, особо не шастайте по путям.</p>', '38.672539', '55.775813'),
(9601755, 2001177, NULL, '38.777686', '55.755753'),
(9602227, 2002094, NULL, '38.700037', '55.774365'),
(9600983, 2000317, NULL, '38.719398', '55.793739'),
(9601876, 2001338, NULL, '38.783522', '55.864739'),
(9600677, 2000011, NULL, '38.787077', '55.883575'),
(9600699, 2000033, NULL, '38.931512', '55.761288'),
(9602082, 2001900, NULL, '38.853853', '55.748001'),
(9600684, 2000018, NULL, '39.102215', '55.868334'),
(9601795, 2001229, NULL, '39.162834', '55.8807'),
(9601645, 2001038, NULL, '39.216503', '55.891593'),
(9601363, 2000719, NULL, '39.28208', '55.904665'),
(9601811, 2001247, NULL, '39.322036', '55.909506'),
(9601828, 2001268, NULL, '39.394217', '55.91824'),
(9601184, 2000522, NULL, '38.9464303', '55.7109592'),
(9601198, 2000536, NULL, '38.878311', '55.612546'),
(9602024, 2001820, '<p>Пройти через турникеты здесь будет нелегко, по 4-5-6 охранников. Лучшего всего спуститься на пути под мостом и перелезть через забор (добрые люди для удобства сделали своеобразные "ступеньки" ).</p>\r\n<h5>Способ №2</h5>\r\n<p>Пойти налево от выхода к турникетам к забору и перелезть.</p>\r\n<h5>Третий способ</h5>\r\n<p>Наиболее легкий и безопасный: пройти в конец платформы, спуститься к забору и через дырку оказаться на воле. Но будьте бдительны: менты стоят на конце платформы и следят, обычно в час пик утром в 6-7 часов и вечером в 19-20 часов.</p>', '38.921526', '55.573052'),
(9601845, 2001296, NULL, '39.033877', '55.565544'),
(9601282, 2000621, NULL, '38.877017', '55.553642'),
(9602211, 2002043, NULL, '38.951195', '55.571334'),
(9601672, 2001067, NULL, '39.111411', '55.559837'),
(9601839, 2001287, NULL, '39.221871', '55.56946'),
(9601808, 2001243, NULL, '39.303307', '55.572475'),
(9601761, 2001183, NULL, '39.408138', '55.572846'),
(9602291, 2002970, '<p>Спрыгиваете с торца платформы (она островная) со стороны тупика отстойника. Переходите на крайний правый путь и идете вдоль зеленого забора, он недолгий, сразу за ним - направо. И вы в городе. На самом мосту пешеходном турникетов нет, так что возвращаемся немного назад и переходим на другую сторону Шатуры, если нужно.</p>', '39.520704', '55.573125'),
(9601165, 2000503, NULL, '39.600604', '55.565255'),
(9601781, 2001209, NULL, '39.687143', '55.559376'),
(9601847, 2001299, NULL, '39.798243', '55.564732'),
(9602062, 2001876, NULL, '39.6732420', '55.4002409'),
