(9601311, 2000650, '<p>Спрыгнуть около турникетов и до пешеходной дорожки 5 метров.</p>', '38.781036', '55.099632');
INSERT INTO `#__rw2_old` (`yandex`, `express`, `detour`, `lt`, `lg`) VALUES
(9600716, 2000050, '<p>Можно спрыгнуть с платформы в сторону Рязани, идти в сторону 3-й платформы (на Озеры), далее обойти здание депо, там есть дырка в заборе, возможно что её заделали, тогда придется перелезать через забор. Также можно обойти по озерской ветке через переезд улицы Октябрьской Революции, но это долго и нудно.</p>\r\n<p>Если прыгать с платформы не хочется, можно пройти по мосту, спуститься на 1-ю (низкую) платформу, далее также идти в стороны 3-й и действовать по предыдущему алгоритму. Вполне реально пройти за кем-нибудь через турникеты, охранники, как правило, вялые, и их мало (один-два).</p>\r\n<p>Так же есть вариант обойти здание вокзала справа (в сторону Москвы) через гаражи, обычно открыты ворота. Если закрыты, то топаем дальше, проходим еще одно здание и в углу забора есть разомкнутые прутья. </p>\r\n<p>Ещё вариант - часто делают дырки с северной стороны станции, далее переход к городу по надземному переходу. </p>', '38.805724', '55.085962'),
(9601844, 2001294, NULL, '38.798997', '55.074245'),
(9601924, 2001397, NULL, '38.75589', '55.070661'),
