(9601011, 2000347, NULL, '39.396231', '54.851515'),
(9601766, 2001189, NULL, '39.474682', '54.768351'),
(9600712, 2000046, NULL, '39.447735', '54.821693'),
(9600681, 2000015, '<p>Спрыгиваем с первого вагона в сторону области и идём налево, либо направо. Справа обход быстрее, так как есть ворота, которые чаще всего открыты. На выход лучше всего использовать паровощинг.</p>', '37.761679', '55.914751'),
(9601887, 2001350, '<p><img title="Как обойти турникеты на Строителе" src="https://pp.userapi.com/c631628/v631628945/10612/GEGnD2nH98g.jpg" alt="Как обойти турникеты на Строителе" width="640" height="384" /></p>', '37.783228', '55.933081'),
(9602281, 2002960, NULL, '37.799772', '55.94778'),
(9601954, 2001435, NULL, '37.808858', '55.962137'),
(9601246, 2000585, NULL, '37.819182', '55.978651'),
(9601241, 2000580, NULL, '37.828747', '55.993984'),
(9600691, 2000025, '<p>Хотя в районе платформы и имеются заборы вдоль путей, но они короткие, и в них имеются специальные проходы совсем рядом с платформой, которые неоднократно пытались заварить, но в итоге смирились с тем, что через подземный переход жители ходить не будут. Поэтому, учитывая также, что платформы на Подлипках низкие, большинство электричкеров практикуют платформ-джампинг, платформ-залазинг и дог-хелпинг.</p>', '37.816301', '55.925465'),
(9602217, 2002080, '<p>Существует четыре платформы: две монинские (в Москву и из Москвы), фрязинская и спутниковая.</p>\r\n<p>На фрязинской платформе турникетов нет.</p>\r\n<h5>На монинских</h5>\r\n<p>На обеих платформах трёхсекционный забор, на платформе в Москву его проще всего перелезать у бывших калиток (под пешеходным мостом и у выхода из подземного перехода), на платформе из Москвы — в любом месте у турникетных павильонов, ведущих на мост; со стороны области есть калитка в 50 м от торца платформы "в Москву"; со стороны Москвы, спрыгнув с торца, можно пройти к подъездному пути ведущему под болшевскую эстакаду — перекрывающие его ворота заваривались столько раз, что их можно использовать как лестницу; также, спрыгнув с московского торца, можно пройти 400 м в сторону Москвы до наземного перехода; также можно доехать до Валентиновки и пройти в обратную сторону, благо расстояние до Болшева сравнительно небольшое (1,5 км).</p>\r\n<h5>На спутниковой</h5>\r\n<p>Можно спрыгнуть с московского торца и пройти 150 м вдоль путей либо в сторону Фрязино, либо в сторону Москвы до пешеходных переходов; со стороны тупиков возможен несложный переджампинг на монинскую платформу "в Москву" и выход через неё; оттуда же можно пройти к подъездному пути под эстакадой.</p>', '37.861022', '55.926201'),
(9600678, 2000012, NULL, '37.891918', '55.924976'),
(9601296, 2000635, NULL, '37.916167', '55.926477'),
(9602301, 2002980, NULL, '37.860993', '55.946873'),
(9601708, 2001117, NULL, '37.87662', '55.963068'),
(9601883, 2001346, '<p>Спрыгиваем с фрязинского торца и сразу видим слева выбитую секцию забора.</p>', '37.908189', '55.96172'),
(9601633, 2001008, '<p>Спрыгиваем с фрязинского торца и свободно проходим в город по протоптанной тропе. Забора вообще нет. Также на платформе слабо закреплен треугольник, его легко будет выбить. Тем более, рядом переезд.</p>', '37.939306', '55.964816'),
(9601628, 2001001, NULL, '37.961832', '55.968163'),
(9602116, 2001935, '	', '38.030501', '55.963364'),
(9601361, 2000715, '<p>Обходинг прост: из последнего вагона (от Москвы) выход через калитку к официальному переходу через пути.</p>\r\n<p><img src="images/wayout/Fryazino-1.jpg" alt="Как обойти турникеты во Фрязино" width="640" height="853" /></p>\r\n<p><img src="images/wayout/Fryazino-2.jpg" alt="Как обойти турникеты во Фрязино" width="640" height="853" /></p>', '38.04442', '55.963252'),
(9602066, 2001880, NULL, '37.945696', '55.927211'),
(9600861, 2000195, '<p>Большинство электричкеров на Воронке используют забор-обходинг, благо забор простирается не далее сотни метров в каждую сторону от платформы. Обычно этот способ практикуют со стороны области. Со стороны Москвы, если смотреть в город, т.е. налево, почти у самого начала платформы забор поставлен весьма удачно, что позволяет спуститься и пройти под ним почти в полный рост.</p>\r\n<p>Таким образом, со стороны москвы обходить забор смысла нет.</p>\r\n<p>Охранников мало и они дежурят у турникетов, и то не всегда.</p>', '37.973943', '55.919135'),
(9601893, 2001360, '<p>Поднимаемся по лестнице на переход, затем спускаемся к турникетам нужной платформы и перелезаем несложный заборчик. На выход - повторить в обратном порядке. Так же можно перелезть через товарняки и затем применить платформ-климбинг.</p>', '38.008823', '55.909353'),
(9601541, 2000914, NULL, '38.036214', '55.906317'),
(9601911, 2001380, '<p>Можно спрыгнуть с любого торца платформы. В 15 метрах от московского торца - легальный пешеходный переход, в 15 метрах от областного - настил, соединяющий две открытые калитки.</p>', '38.062955', '55.897214'),
(9601379, 2000740, NULL, '38.083525', '55.882655'),
(9600682, 2000016, NULL, '38.103086', '55.870252'),
(9601735, 2001148, NULL, '38.134898', '55.861352'),
(9601862, 2001320, '<p>50 метров в сторону Фрязево - легальная открытая калитка в заборе по левую сторону от путей.</p>', '38.197574', '55.843636'),
(9602122, 2001942, NULL, '38.23443', '55.812771'),
(9601206, 2000544, NULL, '38.273636', '55.779714'),
(9602097, 2001915, NULL, '38.363475', '55.754468'),
(9600701, 2000035, '<p>Спрыгиваем в сторону Москвы, проходим метров 100 - слева дырка в заборе.</p>\r\n<p>Также можно выйти с последнего вагона из Москвы и по поручням перелезть на неотурникеченную часть спутниковой платформы.</p>', '37.839358', '56.012293'),
(9601435, 2000800, '<p>Легко спрыгнуть и залезть на платформу! Переходы в 15 и 30 метров от платформы). Удобнее залазить с Московского (Пушкинского) торца, там наварена арматура в виде лесенки.</p>', '37.854396', '56.040227'),
