(9602214, 2002077, NULL, '37.538238', '55.904416'),
(9601261, 2000600, NULL, '37.527869', '55.924415'),
(9600766, 2000100, '<p>Обход через переходы с любого торца платформы.</p>', '37.520917', '55.938288'),
(9601877, 2001340, NULL, '37.512106', '55.952851'),
(9601281, 2000620, NULL, '37.504563', '55.970957'),
(9601996, 2001775, NULL, '37.498601', '55.983698'),
(9600781, 2000115, '<p>Так как турникеты есть только на экспрессной платформе, обойти их очень просто - спрыгиваем с любого торца платформы (точно можно с савёловского торца, с московского не проверялось), переходим пути и залезаем на торец любой другой платформы (они там весьма низкие), далее через переход идем в город.</p>', '37.484389', '56.013196'),
(9602464, 2003966, NULL, '37.486812', '56.028215'),
(9602070, 2001885, NULL, '37.492504', '56.048927'),
