(9602171, 2001992, NULL, '37.701826', '56.315218'),
(9602172, 2001993, NULL, '37.730706', '56.313777'),
(9600692, 2000026, '<p>Масса вариантов: можно перелезть забор рядом с турникетным павильоном (иногда это палится, зато самый быстрый вариант). Можно обойти с московской стороны (тропа хорошо натоптана, но может быть залита водой). Можно обойти и с савёловской стороны (скорее всего, понадобится лезть на грузовую платформу), наконец, можно перелезть прямо по створке рядом с турникетами, а тем, кому надо на левую сторону от Москвы, вообще не надо париться - турникетов там нет.</p>', '37.510175', '56.337577'),
(9601852, 2001306, NULL, '37.516134', '56.382965'),
(9601704, 2001112, NULL, '37.497006', '56.417255'),
