(9612860, NULL, NULL, '41.9458109', '55.5644280'),
(9612194, 2060388, NULL, '41.9955241', '55.5999998'),
(9612704, 2061458, '<p>Самое простое - сразу лезть на мост/с моста для всех платформ, кроме третьей (правда, на спутниковой это может быть несколько неудобно). Идти по путям возможно, но вряд ли имеет смысл.</p>\r\n<p>С первой платформы также можно вылезать на улицу (кратчайший путь к автостанции, если что). На третьей платформе нужно перелезть через забор возле моста.</p>', '41.9457501', '55.6314728'),
