(2060340, 2060340, '<p>С третьей платформы идти в сторону Коврова, к зданию поста электрической централизации (высокое оранжевое здание), там через 150 метров будет калитка и выход к остановке троллейбусов 5, 10, 12.</p>\r\n<p>Также прокатывает трюк с тройкой, стрелкой, неработающей социалкой - мол, ваши турникеты не читают столичные карточки, пойдёмте к контролёру, проверим. Поистерив, бабки все-таки открывают калитку в 100% случаев.</p>', '40.42022', '56.129807'),
