alter table `#__rw_stations`
    add express int default 0 not null comment 'Код ЭКСПРЕСС-3';

alter table `#__rw_stations`
    add lt double(8, 2) default null null comment 'Долгота';

alter table `#__rw_stations`
    add lg double(8, 2) default null null comment 'Ширина';

alter table `#__rw_stations`
    add detour text default null null;

create index `#__rw_stations_express_index`
    on `#__rw_stations` (express);

CREATE TABLE IF NOT EXISTS `#__rw2_old` (
                                               `yandex` int(11) DEFAULT NULL,
                                               `express` int(11) DEFAULT NULL,
                                               `detour` text default null,
                                               `lt` varchar(255) DEFAULT NULL,
                                               `lg` varchar(255) DEFAULT NULL
) ENGINE=InnoDB AUTO_INCREMENT=25780 DEFAULT CHARSET=utf8 COMMENT='Основная информация о станциях';


alter table `#__rw_stations` modify lt varchar(15) default null null comment 'Долгота';
alter table `#__rw_stations` modify lg varchar(15) default null null comment 'Ширина';
update `#__rw_stations` s set s.lt = (select o.lt from `#__rw2_old` o where o.yandex = s.yandex);
update `#__rw_stations` s set s.lg = (select o.lg from `#__rw2_old` o where o.yandex = s.yandex);
update `#__rw_stations` s set s.detour = (select o.detour from `#__rw2_old` o where o.yandex = s.yandex and o.detour is not null);
update `#__rw_stations` set `detour` = null where detour = '';
alter table `#__rw_stations` modify express int default 0 null comment 'Код ЭКСПРЕСС-3';
update `#__rw_stations` s set s.express = (select ifnull(o.express,0) from `#__rw2_old` o where o.yandex = s.yandex);
update `#__rw_stations` set express = 0 where express is null;
alter table `#__rw_stations` modify `express` int default 0 not null comment 'Код ЭКСПРЕСС-3';
drop table `#__rw2_old`;
